INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1000', 'ENTRADAS OU AQUISIÇÕES DE SERVIÇOS DO ESTADO', 'Classificam-se, neste grupo, as operações ou prestações em que o estabelecimento remetente esteja localizado na mesma unidade da Federação do destinatário.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1100', 'COMPRAS PARA INDUSTRIALIZAÇÃO, COMERCIALIZAÇÃO OU PRESTAÇÃO DE SERVIÇOS', NULL);
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1101', 'Compra para industrialização', 'Classificam-se neste código as compras de mercadorias a serem utilizadas em processo de industrialização. Também serão classificadas neste código as entradas de mercadorias em estabelecimento industrial de cooperativa recebidas de seus cooperados ou de estabelecimento de outra cooperativa.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1102', 'Compra para comercialização', 'Classificam-se neste código as compras de mercadorias a serem comercializadas. Também serão classificadas neste código as entradas de mercadorias em estabelecimento comercial de cooperativa recebidas de seus cooperados ou de estabelecimento de outra cooperativa.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1111', 'Compra para industrialização de mercadoria recebida anteriormente em consignação industrial', 'Classificam-se neste código as compras efetivas de mercadorias a serem utilizadas em processo de industrialização, recebidas anteriormente a título de consignação industrial.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1113', 'Compra para comercialização de mercadoria recebida anteriormente em consignação mercantil', 'Classificam-se neste código as compras efetivas de mercadorias recebidas anteriormente a título de consignação mercantil.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1116', 'Compra para industrialização originada de encomenda para recebimento futuro', 'Classificam-se neste código as compras de mercadorias a serem utilizadas em processo de industrialização, quando da entrada real da mercadoria, cuja aquisição tenha sido classificada no código “1.922 - Lançamento efetuado a título de simples faturamento decorrente de compra para recebimento futuro”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1117', 'Compra para comercialização originada de encomenda para recebimento futuro', 'Classificam-se neste código as compras de mercadorias a serem comercializadas, quando da entrada real da mercadoria, cuja aquisição tenha sido classificada no código “1.922 - Lançamento efetuado a título de simples faturamento decorrente de compra para recebimento futuro”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1118', 'Compra de mercadoria para comercialização pelo adquirente originário, entregue pelo vendedor remetente ao destinatário, em venda à ordem', 'Classificam-se neste código as compras de mercadorias já comercializadas, que, sem transitar pelo estabelecimento do adquirente originário, sejam entregues pelo vendedor remetente diretamente ao destinatário, em operação de venda à ordem, cuja venda seja classificada, pelo adquirente originário, no código “5.120 - Venda de mercadoria adquirida ou recebida de terceiros entregue ao destinatário pelo vendedor remetente, em venda à ordem”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1120', 'Compra para industrialização, em venda à ordem, já recebida do vendedor remetente', 'Classificam-se neste código as compras de mercadorias a serem utilizadas em processo de industrialização, em vendas à ordem, já recebidas do vendedor remetente, por ordem do adquirente originário.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1121', 'Compra para comercialização, em venda à ordem, já recebida do vendedor remetente', 'Classificam-se neste código as compras de mercadorias a serem comercializadas, em vendas à ordem, já recebidas do vendedor remetente por ordem do adquirente originário.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1122', 'Compra para industrialização em que a mercadoria foi remetida pelo fornecedor ao industrializador sem transitar pelo estabelecimento adquirente', 'Classificam-se neste código as compras de mercadorias a serem utilizadas em processo de industrialização, remetidas pelo fornecedor para o industrializador sem que a mercadoria tenha transitado pelo estabelecimento do adquirente.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1124', 'Industrialização efetuada por outra empresa', 'Classificam-se neste código as entradas de mercadorias industrializadas por terceiros, compreendendo os valores referentes aos serviços prestados e os das mercadorias de propriedade do industrializador empregadas no processo industrial. Quando a industrialização efetuada se referir a bens do ativo imobilizado ou de mercadorias para uso ou consumo do estabelecimento encomendante, a entrada deverá ser classificada nos códigos “1.551 - Compra de bem para o ativo imobilizado” ou “1.556 - Compra de material para uso ou consumo”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1125', 'Industrialização efetuada por outra empresa quando a mercadoria remetida para utilização no processo de industrialização não transitou pelo estabelecimento adquirente da mercadoria', 'Classificam-se neste código as entradas de mercadorias industrializadas por outras empresas, em que as mercadorias remetidas para utilização no processo de industrialização não transitaram pelo estabelecimento do adquirente das mercadorias, compreendendo os valores referentes aos serviços prestados e os das mercadorias de propriedade do industrializador empregadas no processo industrial. Quando a industrialização efetuada se referir a bens do ativo imobilizado ou de mercadorias para uso ou consumo do estabelecimento encomendante, a entrada deverá ser classificada nos códigos “1.551 - Compra de bem para o ativo imobilizado” ou “1.556 - Compra de material para uso ou consumo”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1126', 'Compra para utilização na prestação de serviço', 'Classificam-se neste código as entradas de mercadorias a serem utilizadas nas prestações de serviços.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1150', 'TRANSFERÊNCIAS PARA INDUSTRIALIZAÇÃO, COMERCIALIZAÇÃO OU PRESTAÇÃO DE SERVIÇOS', NULL);
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1151', 'Transferência para industrialização', 'Classificam-se neste código as entradas de mercadorias recebidas em transferência de outro estabelecimento da mesma empresa, para serem utilizadas em processo de industrialização.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1152', 'Transferência para comercialização', 'Classificam-se neste código as entradas de mercadorias recebidas em transferência de outro estabelecimento da mesma empresa, para serem comercializadas.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1153', 'Transferência de energia elétrica para distribuição', 'Classificam-se neste código as entradas de energia elétrica recebida em transferência de outro estabelecimento da mesma empresa, para distribuição.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1154', 'Transferência para utilização na prestação de serviço', 'Classificam-se neste código as entradas de mercadorias recebidas em transferência de outro estabelecimento da mesma empresa, para serem utilizadas nas prestações de serviços.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1200', 'DEVOLUÇÕES DE VENDAS DE PRODUÇÃO PRÓPRIA, DE TERCEIROS OU ANULAÇÕES DE VALORES', NULL);
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1201', 'Devolução de venda de produção do estabelecimento', 'Classificam-se neste código as devoluções de vendas de produtos industrializados pelo estabelecimento, cujas saídas tenham sido classificadas como “Venda de produção do estabelecimento”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1202', 'Devolução de venda de mercadoria adquirida ou recebida de terceiros', 'Classificam-se neste código as devoluções de vendas de mercadorias adquiridas ou recebidas de terceiros, que não tenham sido objeto de industrialização no estabelecimento, cujas saídas tenham sido classificadas como “Venda de mercadoria adquirida ou recebida de terceiros”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1203', 'Devolução de venda de produção do estabelecimento, destinada à Zona Franca de Manaus ou Áreas de Livre Comércio', 'Classificam-se neste código as devoluções de vendas de produtos industrializados pelo estabelecimento, cujas saídas foram classificadas no código “5.109 - Venda de produção do estabelecimento, destinada à Zona Franca de Manaus ou Áreas de Livre Comércio”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1204', 'Devolução de venda de mercadoria adquirida ou recebida de terceiros, destinada à Zona Franca de Manaus ou Áreas de Livre Comércio', 'Classificam-se neste código as devoluções de vendas de mercadorias adquiridas ou recebidas de terceiros, cujas saídas foram classificadas no código “5.110 - Venda de mercadoria adquirida ou recebida de terceiros, destinada à Zona Franca de Manaus ou Áreas de Livre Comércio”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1205', 'Anulação de valor relativo à prestação de serviço de comunicação', 'Classificam-se neste código as anulações correspondentes a valores faturados indevidamente, decorrentes de prestações de serviços de comunicação.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1206', 'Anulação de valor relativo à prestação de serviço de transporte', 'Classificam-se neste código as anulações correspondentes a valores faturados indevidamente, decorrentes de prestações de serviços de transporte.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1207', 'Anulação de valor relativo à venda de energia elétrica', 'Classificam-se neste código as anulações correspondentes a valores faturados indevidamente, decorrentes de venda de energia elétrica.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1208', 'Devolução de produção do estabelecimento, remetida em transferência', 'Classificam-se neste código as devoluções de produtos industrializados pelo estabelecimento, transferidos para outros estabelecimentos da mesma empresa.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1209', 'Devolução de mercadoria adquirida ou recebida de terceiros, remetida em transferência', 'Classificam-se neste código as devoluções de mercadorias adquiridas ou recebidas de terceiros, transferidas para outros estabelecimentos da mesma empresa.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1250', 'COMPRAS DE ENERGIA ELÉTRICA', NULL);
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1251', 'Compra de energia elétrica para distribuição ou comercialização', 'Classificam-se neste código as compras de energia elétrica utilizada em sistema de distribuição ou comercialização. Também serão classificadas neste código as compras de energia elétrica por cooperativas para distribuição aos seus cooperados.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1252', 'Compra de energia elétrica por estabelecimento industrial', 'Classificam-se neste código as compras de energia elétrica utilizada no processo de industrialização. Também serão classificadas neste código as compras de energia elétrica utilizada por estabelecimento industrial de cooperativa.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1253', 'Compra de energia elétrica por estabelecimento comercial', 'Classificam-se neste código as compras de energia elétrica utilizada por estabelecimento comercial. Também serão classificadas neste código as compras de energia elétrica utilizada por estabelecimento comercial de cooperativa.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1254', 'Compra de energia elétrica por estabelecimento prestador de serviço de transporte', 'Classificam-se neste código as compras de energia elétrica utilizada por estabelecimento prestador de serviços de transporte.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1255', 'Compra de energia elétrica por estabelecimento prestador de serviço de comunicação', 'Classificam-se neste código as compras de energia elétrica utilizada por estabelecimento prestador de serviços de comunicação.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1256', 'Compra de energia elétrica por estabelecimento de produtor rural', 'Classificam-se neste código as compras de energia elétrica utilizada por estabelecimento de produtor rural.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1257', 'Compra de energia elétrica para consumo por demanda contratada', 'Classificam-se neste código as compras de energia elétrica para consumo por demanda contratada, que prevalecerá sobre os demais códigos deste subgrupo.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1300', 'AQUISIÇÕES DE SERVIÇOS DE COMUNICAÇÃO', NULL);
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1301', 'Aquisição de serviço de comunicação para execução de serviço da mesma natureza', 'Classificam-se neste código as aquisições de serviços de comunicação utilizados nas prestações de serviços da mesma natureza.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1302', 'Aquisição de serviço de comunicação por estabelecimento industrial', 'Classificam-se neste código as aquisições de serviços de comunicação utilizados por estabelecimento industrial. Também serão classificadas neste código as aquisições de serviços de comunicação utilizados por estabelecimento industrial de cooperativa.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1303', 'Aquisição de serviço de comunicação por estabelecimento comercial', 'Classificam-se neste código as aquisições de serviços de comunicação utilizados por estabelecimento comercial. Também serão classificadas neste código as aquisições de serviços de comunicação utilizados por estabelecimento comercial de cooperativa.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1304', 'Aquisição de serviço de comunicação por estabelecimento de prestador de serviço de transporte', 'Classificam-se neste código as aquisições de serviços de comunicação utilizados por estabelecimento prestador de serviço de transporte.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1305', 'Aquisição de serviço de comunicação por estabelecimento de geradora ou de distribuidora de energia elétrica', 'Classificam-se neste código as aquisições de serviços de comunicação utilizados por estabelecimento de geradora ou de distribuidora de energia elétrica.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1306', 'Aquisição de serviço de comunicação por estabelecimento de produtor rural', 'Classificam-se neste código as aquisições de serviços de comunicação utilizados por estabelecimento de produtor rural.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1350', 'AQUISIÇÕES DE SERVIÇOS DE TRANSPORTE', NULL);
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1351', 'Aquisição de serviço de transporte para execução de serviço da mesma natureza', 'Classificam-se neste código as aquisições de serviços de transporte utilizados nas prestações de serviços da mesma natureza.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1352', 'Aquisição de serviço de transporte por estabelecimento industrial', 'Classificam-se neste código as aquisições de serviços de transporte utilizados por estabelecimento industrial. Também serão classificadas neste código as aquisições de serviços de transporte utilizados por estabelecimento industrial de cooperativa.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1353', 'Aquisição de serviço de transporte por estabelecimento comercial', 'Classificam-se neste código as aquisições de serviços de transporte utilizados por estabelecimento comercial. Também serão classificadas neste código as aquisições de serviços de transporte utilizados por estabelecimento comercial de cooperativa.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1354', 'Aquisição de serviço de transporte por estabelecimento de prestador de serviço de comunicação', 'Classificam-se neste código as aquisições de serviços de transporte utilizados por estabelecimento prestador de serviços de comunicação.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1355', 'Aquisição de serviço de transporte por estabelecimento de geradora ou de distribuidora de energia elétrica', 'Classificam-se neste código as aquisições de serviços de transporte utilizados por estabelecimento de geradora ou de distribuidora de energia elétrica.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1356', 'Aquisição de serviço de transporte por estabelecimento de produtor rural', 'Classificam-se neste código as aquisições de serviços de transporte utilizados por estabelecimento de produtor rural.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1400', 'ENTRADAS DE MERCADORIAS SUJEITAS AO REGIME DE SUBSTITUIÇÃO TRIBUTÁRIA', NULL);
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1401', 'Compra para industrialização em operação com mercadoria sujeita ao regime de substituição tributária', 'Classificam-se neste código as compras de mercadorias a serem utilizadas em processo de industrialização, decorrentes de operações com mercadorias sujeitas ao regime de substituição tributária. Também serão classificadas neste código as compras por estabelecimento industrial de cooperativa de mercadorias sujeitas ao regime de substituição tributária.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1403', 'Compra para comercialização em operação com mercadoria sujeita ao regime de substituição tributária', 'Classificam-se neste código as compras de mercadorias a serem comercializadas, decorrentes de operações com mercadorias sujeitas ao regime de substituição tributária. Também serão classificadas neste código as compras de mercadorias sujeitas ao regime de substituição tributária em estabelecimento comercial de cooperativa.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1406', 'Compra de bem para o ativo imobilizado cuja mercadoria está sujeita ao regime de substituição tributária', 'Classificam-se neste código as compras de bens destinados ao ativo imobilizado do estabelecimento, em operações com mercadorias sujeitas ao regime de substituição tributária.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1407', 'Compra de mercadoria para uso ou consumo cuja mercadoria está sujeita ao regime de substituição tributária', 'Classificam-se neste código as compras de mercadorias destinadas ao uso ou consumo do estabelecimento, em operações com mercadorias sujeitas ao regime de substituição tributária.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1408', 'Transferência para industrialização em operação com mercadoria sujeita ao regime de substituição tributária', 'Classificam-se neste código as mercadorias recebidas em transferência de outro estabelecimento da mesma empresa, para serem industrializadas no estabelecimento, em operações com mercadorias sujeitas ao regime de substituição tributária.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1409', 'Transferência para comercialização em operação com mercadoria sujeita ao regime de substituição tributária', 'Classificam-se neste código as mercadorias recebidas em transferência de outro estabelecimento da mesma empresa, para serem comercializadas, decorrentes de operações sujeitas ao regime de substituição tributária.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1410', 'Devolução de venda de produção do estabelecimento em operação com produto sujeito ao regime de substituição tributária', 'Classificam-se neste código as devoluções de produtos industrializados e vendidos pelo estabelecimento, cujas saídas tenham sido classificadas como “Venda de produção do estabelecimento em operação com produto sujeito ao regime de substituição tributária”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1411', 'Devolução de venda de mercadoria adquirida ou recebida de terceiros em operação com mercadoria sujeita ao regime de substituição tributária', 'Classificam-se neste código as devoluções de vendas de mercadorias adquiridas ou recebidas de terceiros, cujas saídas tenham sido classificadas como “Venda de mercadoria adquirida ou recebida de terceiros em operação com mercadoria sujeita ao regime de substituição tributária”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1414', 'Retorno de produção do estabelecimento, remetida para venda fora do estabelecimento em operação com produto sujeito ao regime de substituição tributária', 'Classificam-se neste código as entradas, em retorno, de produtos industrializados pelo estabelecimento, remetidos para vendas fora do estabelecimento, inclusive por meio de veículos, em operações com produtos sujeitos ao regime de substituição tributária, e não comercializadas.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1415', 'Retorno de mercadoria adquirida ou recebida de terceiros, remetida para venda fora do estabelecimento em operação com mercadoria sujeita ao regime de substituição tributária', 'Classificam-se neste código as entradas, em retorno, de mercadorias adquiridas ou recebidas de terceiros remetidas para vendas fora do estabelecimento, inclusive por meio de veículos, em operações com mercadorias sujeitas ao regime de substituição tributária, e não comercializadas.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1450', 'SISTEMAS DE INTEGRAÇÃO', NULL);
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1451', 'Retorno de animal do estabelecimento produtor', 'Classificam-se neste código as entradas referentes ao retorno de animais criados pelo produtor no sistema integrado.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1452', 'Retorno de insumo não utilizado na produção', 'Classificam-se neste código o retorno de insumos não utilizados pelo produtor na criação de animais pelo sistema integrado.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1500', 'ENTRADAS DE MERCADORIAS REMETIDAS COM FIM ESPECÍFICO DE EXPORTAÇÃO E EVENTUAIS DEVOLUÇÕES', NULL);
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1501', 'Entrada de mercadoria recebida com fim específico de exportação', 'Classificam-se neste código as entradas de mercadorias em estabelecimento de “trading company”, empresa comercial exportadora ou outro estabelecimento do remetente, com fim específico de exportação.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1503', 'Entrada decorrente de devolução de produto remetido com fim específico de exportação, de produção do estabelecimento', 'Classificam-se neste código as devoluções de produtos industrializados pelo estabelecimento, remetidos a “trading company”, a empresa comercial exportadora ou a outro estabelecimento do remetente, com fim específico de exportação, cujas saídas tenham sido classificadas no código “5.501 - Remessa de produção do estabelecimento, com fim específico de exportação”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1504', 'Entrada decorrente de devolução de mercadoria remetida com fim específico de exportação, adquirida ou recebida de terceiros', 'Classificam-se neste código as devoluções de mercadorias adquiridas ou recebidas de terceiros remetidas a “trading company”, a empresa comercial exportadora ou a outro estabelecimento do remetente, com fim específico de exportação, cujas saídas tenham sido classificadas no código “5.502 - Remessa de mercadoria adquirida ou recebida de terceiros, com fim específico de exportação”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1550', 'OPERAÇÕES COM BENS DE ATIVO IMOBILIZADO E MATERIAIS PARA USO OU CONSUMO', NULL);
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1551', 'Compra de bem para o ativo imobilizado', 'Classificam-se neste código as compras de bens destinados ao ativo imobilizado do estabelecimento.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1552', 'Transferência de bem do ativo imobilizado', 'Classificam-se neste código as entradas de bens destinados ao ativo imobilizado recebidos em transferência de outro estabelecimento da mesma empresa.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1553', 'Devolução de venda de bem do ativo imobilizado', 'Classificam-se neste código as devoluções de vendas de bens do ativo imobilizado, cujas saídas tenham sido classificadas no código “5.551 - Venda de bem do ativo imobilizado”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1554', 'Retorno de bem do ativo imobilizado remetido para uso fora do estabelecimento', 'Classificam-se neste código as entradas por retorno de bens do ativo imobilizado remetidos para uso fora do estabelecimento, cujas saídas tenham sido classificadas no código “5.554 - Remessa de bem do ativo imobilizado para uso fora do estabelecimento”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1555', 'Entrada de bem do ativo imobilizado de terceiro, remetido para uso no estabelecimento', 'Classificam-se neste código as entradas de bens do ativo imobilizado de terceiros, remetidos para uso no estabelecimento.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1556', 'Compra de material para uso ou consumo', 'Classificam-se neste código as compras de mercadorias destinadas ao uso ou consumo do estabelecimento.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1557', 'Transferência de material para uso ou consumo', 'Classificam-se neste código as entradas de materiais para uso ou consumo recebidos em transferência de outro estabelecimento da mesma empresa.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1600', 'CRÉDITOS E RESSARCIMENTOS DE ICMS', NULL);
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1601', 'Recebimento, por transferência, de crédito de ICMS', 'Classificam-se neste código os lançamentos destinados ao registro de créditos de ICMS, recebidos por transferência de outras empresas.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1602', 'Recebimento, por transferência, de saldo credor de ICMS de outro estabelecimento da mesma empresa, para compensação de saldo devedor de ICMS', 'Classificam-se neste código os lançamentos destinados ao registro da transferência de saldos credores de ICMS recebidos de outros estabelecimentos da mesma empresa, destinados à compensação do saldo devedor do estabelecimento.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1603', 'Ressarcimento de ICMS retido por substituição tributária', 'Classificam-se neste código os lançamentos destinados ao registro de ressarcimento de ICMS retido por substituição tributária a contribuinte substituído, efetuado pelo contribuinte substituto, ou, ainda, quando o ressarcimento for apropriado pelo próprio contribuinte substituído, nas hipóteses previstas na legislação aplicável.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1900', 'OUTRAS ENTRADAS DE MERCADORIAS OU AQUISIÇÕES DE SERVIÇOS', NULL);
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1901', 'Entrada para industrialização por encomenda', 'Classificam-se neste código as entradas de insumos recebidos para industrialização por encomenda de outra empresa ou de outro estabelecimento da mesma empresa.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1902', 'Retorno de mercadoria remetida para industrialização por encomenda', 'Classificam-se neste código o retorno dos insumos remetidos para industrialização por encomenda, incorporados ao produto final pelo estabelecimento industrializador.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1903', 'Entrada de mercadoria remetida para industrialização e não aplicada no referido processo', 'Classificam-se neste código as entradas em devolução de insumos remetidos para industrialização e não aplicados no referido processo.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1904', 'Retorno de remessa para venda fora do estabelecimento', 'Classificam-se neste código as entradas em retorno de mercadorias remetidas para venda fora do estabelecimento, inclusive por meio de veículos, e não comercializadas.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1905', 'Entrada de mercadoria recebida para depósito em depósito fechado ou armazém geral', 'Classificam-se neste código as entradas de mercadorias recebidas para depósito em depósito fechado ou armazém geral.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1906', 'Retorno de mercadoria remetida para depósito fechado ou armazém geral', 'Classificam-se neste código as entradas em retorno de mercadorias remetidas para depósito em depósito fechado ou armazém geral.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1907', 'Retorno simbólico de mercadoria remetida para depósito fechado ou armazém geral', 'Classificam-se neste código as entradas em retorno simbólico de mercadorias remetidas para depósito em depósito fechado ou armazém geral, quando as mercadorias depositadas tenham sido objeto de saída a qualquer título e que não tenham retornado ao estabelecimento depositante.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1908', 'Entrada de bem por conta de contrato de comodato', 'Classificam-se neste código as entradas de bens recebidos em cumprimento de contrato de comodato.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1909', 'Retorno de bem remetido por conta de contrato de comodato', 'Classificam-se neste código as entradas de bens recebidos em devolução após cumprido o contrato de comodato.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1910', 'Entrada de bonificação, doação ou brinde', 'Classificam-se neste código as entradas de mercadorias recebidas a título de bonificação, doação ou brinde.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1911', 'Entrada de amostra grátis', 'Classificam-se neste código as entradas de mercadorias recebidas a título de amostra grátis.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1912', 'Entrada de mercadoria ou bem recebido para demonstração', 'Classificam-se neste código as entradas de mercadorias ou bens recebidos para demonstração.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1913', 'Retorno de mercadoria ou bem remetido para demonstração', 'Classificam-se neste código as entradas em retorno de mercadorias ou bens remetidos para demonstração.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1914', 'Retorno de mercadoria ou bem remetido para exposição ou feira', 'Classificam-se neste código as entradas em retorno de mercadorias ou bens remetidos para exposição ou feira.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1915', 'Entrada de mercadoria ou bem recebido para conserto ou reparo', 'Classificam-se neste código as entradas de mercadorias ou bens recebidos para conserto ou reparo.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1916', 'Retorno de mercadoria ou bem remetido para conserto ou reparo', 'Classificam-se neste código as entradas em retorno de mercadorias ou bens remetidos para conserto ou reparo.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1917', 'Entrada de mercadoria recebida em consignação mercantil ou industrial', 'Classificam-se neste código as entradas de mercadorias recebidas a título de consignação mercantil ou industrial.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1918', 'Devolução de mercadoria remetida em consignação mercantil ou industrial', 'Classificam-se neste código as entradas por devolução de mercadorias remetidas anteriormente a título de consignação mercantil ou industrial.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1919', 'Devolução simbólica de mercadoria vendida ou utilizada em processo industrial, remetida anteriormente em consignação mercantil ou industrial', 'Classificam-se neste código as entradas por devolução simbólica de mercadorias vendidas ou utilizadas em processo industrial, remetidas anteriormente a título de consignação mercantil ou industrial.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1920', 'Entrada de vasilhame ou sacaria', 'Classificam-se neste código as entradas de vasilhame ou sacaria.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1921', 'Retorno de vasilhame ou sacaria', 'Classificam-se neste código as entradas em retorno de vasilhame ou sacaria.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1922', 'Lançamento efetuado a título de simples faturamento decorrente de compra para recebimento futuro', 'Classificam-se neste código os registros efetuados a título de simples faturamento decorrente de compra para recebimento futuro.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1923', 'Entrada de mercadoria recebida do vendedor remetente, em venda à ordem', 'Classificam-se neste código as entradas de mercadorias recebidas do vendedor remetente, em vendas à ordem, cuja compra do adquirente originário, foi classificada nos códigos “1.120 - Compra para industrialização, em venda à ordem, já recebida do vendedor remetente” ou “1.121 - Compra para comercialização, em venda à ordem, já recebida do vendedor remetente”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1924', 'Entrada para industrialização por conta e ordem do adquirente da mercadoria, quando esta não transitar pelo estabelecimento do adquirente', 'Classificam-se neste código as entradas de insumos recebidos para serem industrializados por conta e ordem do adquirente, nas hipóteses em que os insumos não tenham transitado pelo estabelecimento do adquirente dos mesmos.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1925', 'Retorno de mercadoria remetida para industrialização por conta e ordem do adquirente da mercadoria, quando esta não transitar pelo estabelecimento do adquirente', 'Classificam-se neste código o retorno dos insumos remetidos por conta e ordem do adquirente, para industrialização e incorporados ao produto final pelo estabelecimento industrializador, nas hipóteses em que os insumos não tenham transitado pelo estabelecimento do adquirente.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1926', 'Lançamento efetuado a título de reclassificação de mercadoria decorrente de formação de kit ou de sua desagregação', 'Classificam-se neste código os registros efetuados a título de reclassificação decorrente de formação de kit de mercadorias ou de sua desagregação.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('1949', 'Outra entrada de mercadoria ou prestação de serviço não especificada', 'Classificam-se neste código as outras entradas de mercadorias ou prestações de serviços que não tenham sido especificadas nos códigos anteriores.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2000', 'ENTRADAS OU AQUISIÇÕES DE SERVIÇOS DE OUTROS ESTADOS', 'Classificam-se, neste grupo, as operações ou prestações em que o estabelecimento remetente esteja localizado em unidade da Federação diversa daquela do destinatário.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2100', 'COMPRAS PARA INDUSTRIALIZAÇÃO, COMERCIALIZAÇÃO OU PRESTAÇÃO DE SERVIÇOS', NULL);
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2101', 'Compra para industrialização', 'Classificam-se neste código as compras de mercadorias a serem utilizadas em processo de industrialização. Também serão classificadas neste código as entradas de mercadorias em estabelecimento industrial de cooperativa recebidas de seus cooperados ou de estabelecimento de outra cooperativa.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2102', 'Compra para comercialização', 'Classificam-se neste código as compras de mercadorias a serem comercializadas. Também serão classificadas neste código as entradas de mercadorias em estabelecimento comercial de cooperativa recebidas de seus cooperados ou de estabelecimento de outra cooperativa.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2111', 'Compra para industrialização de mercadoria recebida anteriormente em consignação industrial', 'Classificam-se neste código as compras efetivas de mercadorias a serem utilizadas em processo de industrialização, recebidas anteriormente a título de consignação industrial.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2113', 'Compra para comercialização, de mercadoria recebida anteriormente em consignação mercantil', 'Classificam-se neste código as compras efetivas de mercadorias recebidas anteriormente a título de consignação mercantil.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2116', 'Compra para industrialização originada de encomenda para recebimento futuro', 'Classificam-se neste código as compras de mercadorias a serem utilizadas em processo de industrialização, quando da entrada real da mercadoria, cuja aquisição tenha sido classificada no código “2.922 - Lançamento efetuado a título de simples faturamento decorrente de compra para recebimento futuro”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2117', 'Compra para comercialização originada de encomenda para recebimento futuro', 'Classificam-se neste código as compras de mercadorias a serem comercializadas, quando da entrada real da mercadoria, cuja aquisição tenha sido classificada no código “2.922 - Lançamento efetuado a título de simples faturamento decorrente de compra para recebimento futuro”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2118', 'Compra de mercadoria para comercialização pelo adquirente originário, entregue pelo vendedor remetente ao destinatário, em venda à ordem', 'Classificam-se neste código as compras de mercadorias já comercializadas, que, sem transitar pelo estabelecimento do adquirente originário, sejam entregues pelo vendedor remetente diretamente ao destinatário, em operação de venda à ordem, cuja venda seja classificada, pelo adquirente originário, no código “6.120 - Venda de mercadoria adquirida ou recebida de terceiros entregue ao destinatário pelo vendedor remetente, em venda à ordem”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2120', 'Compra para industrialização, em venda à ordem, já recebida do vendedor remetente', 'Classificam-se neste código as compras de mercadorias a serem utilizadas em processo de industrialização, em vendas à ordem, já recebidas do vendedor remetente, por ordem do adquirente originário.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2121', 'Compra para comercialização, em venda à ordem, já recebida do vendedor remetente', 'Classificam-se neste código as compras de mercadorias a serem comercializadas, em vendas à ordem, já recebidas do vendedor remetente por ordem do adquirente originário.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2122', 'Compra para industrialização em que a mercadoria foi remetida pelo fornecedor ao industrializador sem transitar pelo estabelecimento adquirente', 'Classificam-se neste código as compras de mercadorias a serem utilizadas em processo de industrialização, remetidas pelo fornecedor para o industrializador sem que a mercadoria tenha transitado pelo estabelecimento do adquirente.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2124', 'Industrialização efetuada por outra empresa', 'Classificam-se neste código as entradas de mercadorias industrializadas por terceiros, compreendendo os valores referentes aos serviços prestados e os das mercadorias de propriedade do industrializador empregadas no processo industrial. Quando a industrialização efetuada se referir a bens do ativo imobilizado ou de mercadorias para uso ou consumo do estabelecimento encomendante, a entrada deverá ser classificada nos códigos “2.551 - Compra de bem para o ativo imobilizado” ou “2.556 - Compra de material para uso ou consumo”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2125', 'Industrialização efetuada por outra empresa quando a mercadoria remetida para utilização no processo de industrialização não transitou pelo estabelecimento adquirente da mercadoria', 'Classificam-se neste código as entradas de mercadorias industrializadas por outras empresas, em que as mercadorias remetidas para utilização no processo de industrialização não transitaram pelo estabelecimento do adquirente das mercadorias, compreendendo os valores referentes aos serviços prestados e os das mercadorias de propriedade do industrializador empregadas no processo industrial. Quando a industrialização efetuada se referir a bens do ativo imobilizado ou de mercadorias para uso ou consumo do estabelecimento encomendante, a entrada deverá ser classificada nos códigos “2.551 - Compra de bem para o ativo imobilizado” ou “2.556 - Compra de material para uso ou consumo”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2126', 'Compra para utilização na prestação de serviço', 'Classificam-se neste código as entradas de mercadorias a serem utilizadas nas prestações de serviços.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2150', 'TRANSFERÊNCIAS PARA INDUSTRIALIZAÇÃO, COMERCIALIZAÇÃO OU PRESTAÇÃO DE SERVIÇOS', NULL);
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2151', 'Transferência para industrialização', 'Classificam-se neste código as entradas de mercadorias recebidas em transferência de outro estabelecimento da mesma empresa, para serem utilizadas em processo de industrialização.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2152', 'Transferência para comercialização', 'Classificam-se neste código as entradas de mercadorias recebidas em transferência de outro estabelecimento da mesma empresa, para serem comercializadas.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2153', 'Transferência de energia elétrica para distribuição', 'Classificam-se neste código as entradas de energia elétrica recebida em transferência de outro estabelecimento da mesma empresa, para distribuição.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2154', 'Transferência para utilização na prestação de serviço', 'Classificam-se neste código as entradas de mercadorias recebidas em transferência de outro estabelecimento da mesma empresa, para serem utilizadas nas prestações de serviços.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2200', 'DEVOLUÇÕES DE VENDAS DE PRODUÇÃO PRÓPRIA, DE TERCEIROS OU ANULAÇÕES DE VALORES', NULL);
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2201', 'Devolução de venda de produção do estabelecimento', 'Classificam-se neste código as devoluções de vendas de produtos industrializados pelo estabelecimento, cujas saídas tenham sido classificadas como “Venda de produção do estabelecimento”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2202', 'Devolução de venda de mercadoria adquirida ou recebida de terceiros', 'Classificam-se neste código as devoluções de vendas de mercadorias adquiridas ou recebidas de terceiros, que não tenham sido objeto de industrialização no estabelecimento, cujas saídas tenham sido classificadas como “Venda de mercadoria adquirida ou recebida de terceiros”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2203', 'Devolução de venda de produção do estabelecimento, destinada à Zona Franca de Manaus ou Áreas de Livre Comércio', 'Classificam-se neste código as devoluções de vendas de produtos industrializados pelo estabelecimento, cujas saídas foram classificadas no código “6.109 - Venda de produção do estabelecimento, destinada à Zona Franca de Manaus ou Áreas de Livre Comércio”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2204', 'Devolução de venda de mercadoria adquirida ou recebida de terceiros, destinada à Zona Franca de Manaus ou Áreas de Livre Comércio', 'Classificam-se neste código as devoluções de vendas de mercadorias adquiridas ou recebidas de terceiros, cujas saídas foram classificadas no código “6.110 - Venda de mercadoria adquirida ou recebida de terceiros, destinada à Zona Franca de Manaus ou Áreas de Livre Comércio”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2205', 'Anulação de valor relativo à prestação de serviço de comunicação', 'Classificam-se neste código as anulações correspondentes a valores faturados indevidamente, decorrentes de prestações de serviços de comunicação.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2206', 'Anulação de valor relativo à prestação de serviço de transporte', 'Classificam-se neste código as anulações correspondentes a valores faturados indevidamente, decorrentes de prestações de serviços de transporte.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2207', 'Anulação de valor relativo à venda de energia elétrica', 'Classificam-se neste código as anulações correspondentes a valores faturados indevidamente, decorrentes de venda de energia elétrica.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2208', 'Devolução de produção do estabelecimento, remetida em transferência', 'Classificam-se neste código as devoluções de produtos industrializados pelo estabelecimento, transferidos para outros estabelecimentos da mesma empresa.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2209', 'Devolução de mercadoria adquirida ou recebida de terceiros, remetida em transferência', 'Classificam-se neste código as devoluções de mercadorias adquiridas ou recebidas de terceiros, transferidas para outros estabelecimentos da mesma empresa.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2250', 'COMPRAS DE ENERGIA ELÉTRICA', NULL);
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2251', 'Compra de energia elétrica para distribuição ou comercialização', 'Classificam-se neste código as compras de energia elétrica utilizada em sistema de distribuição ou comercialização. Também serão classificadas neste código as compras de energia elétrica por cooperativas para distribuição aos seus cooperados.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2252', 'Compra de energia elétrica por estabelecimento industrial', 'Classificam-se neste código as compras de energia elétrica utilizada no processo de industrialização. Também serão classificadas neste código as compras de energia elétrica utilizada por estabelecimento industrial de cooperativa.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2253', 'Compra de energia elétrica por estabelecimento comercial', 'Classificam-se neste código as compras de energia elétrica utilizada por estabelecimento comercial. Também serão classificadas neste código as compras de energia elétrica utilizada por estabelecimento comercial de cooperativa.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2254', 'Compra de energia elétrica por estabelecimento prestador de serviço de transporte', 'Classificam-se neste código as compras de energia elétrica utilizada por estabelecimento prestador de serviços de transporte.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2255', 'Compra de energia elétrica por estabelecimento prestador de serviço de comunicação', 'Classificam-se neste código as compras de energia elétrica utilizada por estabelecimento prestador de serviços de comunicação.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2256', 'Compra de energia elétrica por estabelecimento de produtor rural', 'Classificam-se neste código as compras de energia elétrica utilizada por estabelecimento de produtor rural.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2257', 'Compra de energia elétrica para consumo por demanda contratada', 'Classificam-se neste código as compras de energia elétrica para consumo por demanda contratada, que prevalecerá sobre os demais códigos deste subgrupo.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2300', 'AQUISIÇÕES DE SERVIÇOS DE COMUNICAÇÃO', NULL);
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2301', 'Aquisição de serviço de comunicação para execução de serviço da mesma natureza', 'Classificam-se neste código as aquisições de serviços de comunicação utilizados nas prestações de serviços da mesma natureza.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2302', 'Aquisição de serviço de comunicação por estabelecimento industrial', 'Classificam-se neste código as aquisições de serviços de comunicação utilizados por estabelecimento industrial. Também serão classificadas neste código as aquisições de serviços de comunicação utilizados por estabelecimento industrial de cooperativa.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2303', 'Aquisição de serviço de comunicação por estabelecimento comercial', 'Classificam-se neste código as aquisições de serviços de comunicação utilizados por estabelecimento comercial. Também serão classificadas neste código as aquisições de serviços de comunicação utilizados por estabelecimento comercial de cooperativa.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2304', 'Aquisição de serviço de comunicação por estabelecimento de prestador de serviço de transporte', 'Classificam-se neste código as aquisições de serviços de comunicação utilizado por estabelecimento prestador de serviço de transporte.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2305', 'Aquisição de serviço de comunicação por estabelecimento de geradora ou de distribuidora de energia elétrica', 'Classificam-se neste código as aquisições de serviços de comunicação utilizados por estabelecimento de geradora ou de distribuidora de energia elétrica.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2306', 'Aquisição de serviço de comunicação por estabelecimento de produtor rural', 'Classificam-se neste código as aquisições de serviços de comunicação utilizados por estabelecimento de produtor rural.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2350', 'AQUISIÇÕES DE SERVIÇOS DE TRANSPORTE', NULL);
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2351', 'Aquisição de serviço de transporte para execução de serviço da mesma natureza', 'Classificam-se neste código as aquisições de serviços de transporte utilizados nas prestações de serviços da mesma natureza.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2352', 'Aquisição de serviço de transporte por estabelecimento industrial', 'Classificam-se neste código as aquisições de serviços de transporte utilizados por estabelecimento industrial. Também serão classificadas neste código as aquisições de serviços de transporte utilizados por estabelecimento industrial de cooperativa.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2353', 'Aquisição de serviço de transporte por estabelecimento comercial', 'Classificam-se neste código as aquisições de serviços de transporte utilizados por estabelecimento comercial. Também serão classificadas neste código as aquisições de serviços de transporte utilizados por estabelecimento comercial de cooperativa.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2354', 'Aquisição de serviço de transporte por estabelecimento de prestador de serviço de comunicação', 'Classificam-se neste código as aquisições de serviços de transporte utilizados por estabelecimento prestador de serviços de comunicação.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2355', 'Aquisição de serviço de transporte por estabelecimento de geradora ou de distribuidora de energia elétrica', 'Classificam-se neste código as aquisições de serviços de transporte utilizados por estabelecimento de geradora ou de distribuidora de energia elétrica.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2356', 'Aquisição de serviço de transporte por estabelecimento de produtor rural', 'Classificam-se neste código as aquisições de serviços de transporte utilizados por estabelecimento de produtor rural.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2400', 'ENTRADAS DE MERCADORIAS SUJEITAS AO REGIME DE SUBSTITUIÇÃO TRIBUTÁRIA', NULL);
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2401', 'Compra para industrialização em operação com mercadoria sujeita ao regime de substituição tributária', 'Classificam-se neste código as compras de mercadorias a serem utilizadas em processo de industrialização, decorrentes de operações com mercadorias sujeitas ao regime de substituição tributária. Também serão classificadas neste código as compras por estabelecimento industrial de cooperativa de mercadorias sujeitas ao regime de substituição tributária.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2403', 'Compra para comercialização em operação com mercadoria sujeita ao regime de substituição tributária', 'Classificam-se neste código as compras de mercadorias a serem comercializadas, decorrentes de operações com mercadorias sujeitas ao regime de substituição tributária. Também serão classificadas neste código as compras de mercadorias sujeitas ao regime de substituição tributária em estabelecimento comercial de cooperativa.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2406', 'Compra de bem para o ativo imobilizado cuja mercadoria está sujeita ao regime de substituição tributária', 'Classificam-se neste código as compras de bens destinados ao ativo imobilizado do estabelecimento, em operações com mercadorias sujeitas ao regime de substituição tributária.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2407', 'Compra de mercadoria para uso ou consumo cuja mercadoria está sujeita ao regime de substituição tributária', 'Classificam-se neste código as compras de mercadorias destinadas ao uso ou consumo do estabelecimento, em operações com mercadorias sujeitas ao regime de substituição tributária.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2408', 'Transferência para industrialização em operação com mercadoria sujeita ao regime de substituição tributária', 'Classificam-se neste código as mercadorias recebidas em transferência de outro estabelecimento da mesma empresa, para serem industrializadas no estabelecimento, em operações com mercadorias sujeitas ao regime de substituição tributária.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2409', 'Transferência para comercialização em operação com mercadoria sujeita ao regime de substituição tributária', 'Classificam-se neste código as mercadorias recebidas em transferência de outro estabelecimento da mesma empresa, para serem comercializadas, decorrentes de operações sujeitas ao regime de substituição tributária.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2410', 'Devolução de venda de produção do estabelecimento em operação com produto sujeito ao regime de substituição tributária', 'Classificam-se neste código as devoluções de produtos industrializados e vendidos pelo estabelecimento, cujas saídas tenham sido classificadas como “Venda de produção do estabelecimento em operação com produto sujeito ao regime de substituição tributária”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2411', 'Devolução de venda de mercadoria adquirida ou recebida de terceiros em operação com mercadoria sujeita ao regime de substituição tributária', 'Classificam-se neste código as devoluções de vendas de mercadorias adquiridas ou recebidas de terceiros, cujas saídas tenham sido classificadas como “Venda de mercadoria adquirida ou recebida de terceiros em operação com mercadoria sujeita ao regime de substituição tributária”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2414', 'Retorno de produção do estabelecimento, remetida para venda fora do estabelecimento em operação com produto sujeito ao regime de substituição tributária', 'Classificam-se neste código as entradas, em retorno, de produtos industrializados pelo estabelecimento, remetidos para vendas fora do estabelecimento, inclusive por meio de veículos, em operações com produtos sujeitos ao regime de substituição tributária, e não comercializadas.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2415', 'Retorno de mercadoria adquirida ou recebida de terceiros, remetida para venda fora do estabelecimento em operação com mercadoria sujeita ao regime de substituição tributária', 'Classificam-se neste código as entradas, em retorno, de mercadorias adquiridas ou recebidas de terceiros remetidas para vendas fora do estabelecimento, inclusive por meio de veículos, em operações com mercadorias sujeitas ao regime de substituição tributária, e não comercializadas.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2500', 'ENTRADAS DE MERCADORIAS REMETIDAS COM FIM ESPECÍFICO DE EXPORTAÇÃO E EVENTUAIS DEVOLUÇÕES', NULL);
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2501', 'Entrada de mercadoria recebida com fim específico de exportação', 'Classificam-se neste código as entradas de mercadorias em estabelecimento de “trading company”, empresa comercial exportadora ou outro estabelecimento do remetente, com fim específico de exportação.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2503', 'Entrada decorrente de devolução de produto remetido com fim específico de exportação, de produção do estabelecimento', 'Classificam-se neste código as devoluções de produtos industrializados pelo estabelecimento, remetidos a “trading company”, a empresa comercial exportadora ou a outro estabelecimento do remetente, com fim específico de exportação, cujas saídas tenham sido classificadas no código “6.501 - Remessa de produção do estabelecimento, com fim específico de exportação”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2504', 'Entrada decorrente de devolução de mercadoria remetida com fim específico de exportação, adquirida ou recebida de terceiros', 'Classificam-se neste código as devoluções de mercadorias adquiridas ou recebidas de terceiros remetidas a “trading company”, a empresa comercial exportadora ou a outro estabelecimento do remetente, com fim específico de exportação, cujas saídas tenham sido classificadas no código “6.502 - Remessa de mercadoria adquirida ou recebida de terceiros, com fim específico de exportação”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2550', 'OPERAÇÕES COM BENS DE ATIVO IMOBILIZADO E MATERIAIS PARA USO OU CONSUMO', NULL);
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2551', 'Compra de bem para o ativo imobilizado', 'Classificam-se neste código as compras de bens destinados ao ativo imobilizado do estabelecimento.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2552', 'Transferência de bem do ativo imobilizado', 'Classificam-se neste código as entradas de bens destinados ao ativo imobilizado recebidos em transferência de outro estabelecimento da mesma empresa.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2553', 'Devolução de venda de bem do ativo imobilizado', 'Classificam-se neste código as devoluções de vendas de bens do ativo imobilizado, cujas saídas tenham sido classificadas no código “6.551 - Venda de bem do ativo imobilizado”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2554', 'Retorno de bem do ativo imobilizado remetido para uso fora do estabelecimento', 'Classificam-se neste código as entradas por retorno de bens do ativo imobilizado remetidos para uso fora do estabelecimento, cujas saídas tenham sido classificadas no código “6.554 - Remessa de bem do ativo imobilizado para uso fora do estabelecimento”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2555', 'Entrada de bem do ativo imobilizado de terceiro, remetido para uso no estabelecimento', 'Classificam-se neste código as entradas de bens do ativo imobilizado de terceiros, remetidos para uso no estabelecimento.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2556', 'Compra de material para uso ou consumo', 'Classificam-se neste código as compras de mercadorias destinadas ao uso ou consumo do estabelecimento.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2557', 'Transferência de material para uso ou consumo', 'Classificam-se neste código as entradas de materiais para uso ou consumo recebidos em transferência de outro estabelecimento da mesma empresa.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2600', 'CRÉDITOS E RESSARCIMENTOS DE ICMS', NULL);
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2603', 'Ressarcimento de ICMS retido por substituição tributária', 'Classificam-se neste código os lançamentos destinados ao registro de ressarcimento de ICMS retido por substituição tributária a contribuinte substituído, efetuado pelo contribuinte substituto, nas hipóteses previstas na legislação aplicável.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2900', 'OUTRAS ENTRADAS DE MERCADORIAS OU AQUISIÇÕES DE SERVIÇOS', NULL);
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2901', 'Entrada para industrialização por encomenda', 'Classificam-se neste código as entradas de insumos recebidos para industrialização por encomenda de outra empresa ou de outro estabelecimento da mesma empresa.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2902', 'Retorno de mercadoria remetida para industrialização por encomenda', 'Classificam-se neste código o retorno dos insumos remetidos para industrialização por encomenda, incorporados ao produto final pelo estabelecimento industrializador.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2903', 'Entrada de mercadoria remetida para industrialização e não aplicada no referido processo', 'Classificam-se neste código as entradas em devolução de insumos remetidos para industrialização e não aplicados no referido processo.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2904', 'Retorno de remessa para venda fora do estabelecimento', 'Classificam-se neste código as entradas em retorno de mercadorias remetidas para venda fora do estabelecimento, inclusive por meio de veículos, e não comercializadas.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2905', 'Entrada de mercadoria recebida para depósito em depósito fechado ou armazém geral', 'Classificam-se neste código as entradas de mercadorias recebidas para depósito em depósito fechado ou armazém geral.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2906', 'Retorno de mercadoria remetida para depósito fechado ou armazém geral', 'Classificam-se neste código as entradas em retorno de mercadorias remetidas para depósito em depósito fechado ou armazém geral.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2907', 'Retorno simbólico de mercadoria remetida para depósito fechado ou armazém geral', 'Classificam-se neste código as entradas em retorno simbólico de mercadorias remetidas para depósito em depósito fechado ou armazém geral, quando as mercadorias depositadas tenham sido objeto de saída a qualquer título e que não tenham retornado ao estabelecimento depositante.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2908', 'Entrada de bem por conta de contrato de comodato', 'Classificam-se neste código as entradas de bens recebidos em cumprimento de contrato de comodato.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2909', 'Retorno de bem remetido por conta de contrato de comodato', 'Classificam-se neste código as entradas de bens recebidos em devolução após cumprido o contrato de comodato.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2910', 'Entrada de bonificação, doação ou brinde', 'Classificam-se neste código as entradas de mercadorias recebidas a título de bonificação, doação ou brinde.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2911', 'Entrada de amostra grátis', 'Classificam-se neste código as entradas de mercadorias recebidas a título de amostra grátis.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2912', 'Entrada de mercadoria ou bem recebido para demonstração', 'Classificam-se neste código as entradas de mercadorias ou bens recebidos para demonstração.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2913', 'Retorno de mercadoria ou bem remetido para demonstração', 'Classificam-se neste código as entradas em retorno de mercadorias ou bens remetidos para demonstração.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2914', 'Retorno de mercadoria ou bem remetido para exposição ou feira', 'Classificam-se neste código as entradas em retorno de mercadorias ou bens remetidos para exposição ou feira.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2915', 'Entrada de mercadoria ou bem recebido para conserto ou reparo', 'Classificam-se neste código as entradas de mercadorias ou bens recebidos para conserto ou reparo.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2916', 'Retorno de mercadoria ou bem remetido para conserto ou reparo', 'Classificam-se neste código as entradas em retorno de mercadorias ou bens remetidos para conserto ou reparo.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2917', 'Entrada de mercadoria recebida em consignação mercantil ou industrial', 'Classificam-se neste código as entradas de mercadorias recebidas a título de consignação mercantil ou industrial.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2918', 'Devolução de mercadoria remetida em consignação mercantil ou industrial', 'Classificam-se neste código as entradas por devolução de mercadorias remetidas anteriormente a título de consignação mercantil ou industrial.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2919', 'Devolução simbólica de mercadoria vendida ou utilizada em processo industrial, remetida anteriormente em consignação mercantil ou industrial', 'Classificam-se neste código as entradas por devolução simbólica de mercadorias vendidas ou utilizadas em processo industrial, remetidas anteriormente a título de consignação mercantil ou industrial.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2920', 'Entrada de vasilhame ou sacaria', 'Classificam-se neste código as entradas de vasilhame ou sacaria.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2921', 'Retorno de vasilhame ou sacaria', 'Classificam-se neste código as entradas em retorno de vasilhame ou sacaria.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2922', 'Lançamento efetuado a título de simples faturamento decorrente de compra para recebimento futuro', 'Classificam-se neste código os registros efetuados a título de simples faturamento decorrente de compra para recebimento futuro.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2923', 'Entrada de mercadoria recebida do vendedor remetente, em venda à ordem', 'Classificam-se neste código as entradas de mercadorias recebidas do vendedor remetente, em vendas à ordem, cuja compra do adquirente originário, foi classificada nos códigos “2.120 - Compra para industrialização, em venda à ordem, já recebida do vendedor remetente” ou “2.121 - Compra para comercialização, em venda à ordem, já recebida do vendedor remetente”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2924', 'Entrada para industrialização por conta e ordem do adquirente da mercadoria, quando esta não transitar pelo estabelecimento do adquirente', 'Classificam-se neste código as entradas de insumos recebidos para serem industrializados por conta e ordem do adquirente, nas hipóteses em que os insumos não tenham transitado pelo estabelecimento do adquirente dos mesmos.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2925', 'Retorno de mercadoria remetida para industrialização por conta e ordem do adquirente da mercadoria, quando esta não transitar pelo estabelecimento do adquirente', 'Classificam-se neste código o retorno dos insumos remetidos por conta e ordem do adquirente, para industrialização e incorporados ao produto final pelo estabelecimento industrializador, nas hipóteses em que os insumos não tenham transitado pelo estabelecimento do adquirente.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('2949', 'Outra entrada de mercadoria ou prestação de serviço não especificado', 'Classificam-se neste código as outras entradas de mercadorias ou prestações de serviços que não tenham sido especificados nos códigos anteriores.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('3000', 'ENTRADAS OU AQUISIÇÕES DE SERVIÇOS DO EXTERIOR', 'Classificam-se, neste grupo, as entradas de mercadorias oriundas de outro país, inclusive as decorrentes de aquisição por arrematação, concorrência ou qualquer outra forma de alienação promovida pelo poder público, e os serviços iniciados no exterior.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('3100', 'COMPRAS PARA INDUSTRIALIZAÇÃO, COMERCIALIZAÇÃO OU PRESTAÇÃO DE SERVIÇOS', NULL);
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('3101', 'Compra para industrialização', 'Classificam-se neste código as compras de mercadorias a serem utilizadas em processo de industrialização. Também serão classificadas neste código as entradas de mercadorias em estabelecimento industrial de cooperativa.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('3102', 'Compra para comercialização', 'Classificam-se neste código as compras de mercadorias a serem comercializadas. Também serão classificadas neste código as entradas de mercadorias em estabelecimento comercial de cooperativa.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('3126', 'Compra para utilização na prestação de serviço', 'Classificam-se neste código as entradas de mercadorias a serem utilizadas nas prestações de serviços.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('3127', 'Compra para industrialização sob o regime de “drawback”', 'Classificam-se neste código as compras de mercadorias a serem utilizadas em processo de industrialização e posterior exportação do produto resultante, cujas vendas serão classificadas no código “7.127 - Venda de produção do estabelecimento sob o regime de “drawback””.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('3200', 'DEVOLUÇÕES DE VENDAS DE PRODUÇÃO PRÓPRIA, DE TERCEIROS OU ANULAÇÕES DE VALORES', NULL);
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('3201', 'Devolução de venda de produção do estabelecimento', 'Classificam-se neste código as devoluções de vendas de produtos industrializados pelo estabelecimento, cujas saídas tenham sido classificadas como “Venda de produção do estabelecimento”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('3202', 'Devolução de venda de mercadoria adquirida ou recebida de terceiros', 'Classificam-se neste código as devoluções de vendas de mercadorias adquiridas ou recebidas de terceiros, que não tenham sido objeto de industrialização no estabelecimento, cujas saídas tenham sido classificadas como “Venda de mercadoria adquirida ou recebida de terceiros”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('3205', 'Anulação de valor relativo à prestação de serviço de comunicação', 'Classificam-se neste código as anulações correspondentes a valores faturados indevidamente, decorrentes de prestações de serviços de comunicação.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('3206', 'Anulação de valor relativo à prestação de serviço de transporte', 'Classificam-se neste código as anulações correspondentes a valores faturados indevidamente, decorrentes de prestações de serviços de transporte.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('3207', 'Anulação de valor relativo à venda de energia elétrica', 'Classificam-se neste código as anulações correspondentes a valores faturados indevidamente, decorrentes de venda de energia elétrica.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('3211', 'Devolução de venda de produção do estabelecimento sob o regime de “drawback”', 'Classificam-se neste código as devoluções de vendas de produtos industrializados pelo estabelecimento sob o regime de “drawback”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('3250', 'COMPRAS DE ENERGIA ELÉTRICA', NULL);
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('3251', 'Compra de energia elétrica para distribuição ou comercialização', 'Classificam-se neste código as compras de energia elétrica utilizada em sistema de distribuição ou comercialização. Também serão classificadas neste código as compras de energia elétrica por cooperativas para distribuição aos seus cooperados.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('3300', 'AQUISIÇÕES DE SERVIÇOS DE COMUNICAÇÃO', NULL);
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('3301', 'Aquisição de serviço de comunicação para execução de serviço da mesma natureza', 'Classificam-se neste código as aquisições de serviços de comunicação utilizados nas prestações de serviços da mesma natureza.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('3350', 'AQUISIÇÕES DE SERVIÇOS DE TRANSPORTE', NULL);
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('3351', 'Aquisição de serviço de transporte para execução de serviço da mesma natureza', 'Classificam-se neste código as aquisições de serviços de transporte utilizados nas prestações de serviços da mesma natureza.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('3352', 'Aquisição de serviço de transporte por estabelecimento industrial', 'Classificam-se neste código as aquisições de serviços de transporte utilizados por estabelecimento industrial. Também serão classificadas neste código as aquisições de serviços de transporte utilizados por estabelecimento industrial de cooperativa.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('3353', 'Aquisição de serviço de transporte por estabelecimento comercial', 'Classificam-se neste código as aquisições de serviços de transporte utilizados por estabelecimento comercial. Também serão classificadas neste código as aquisições de serviços de transporte utilizados por estabelecimento comercial de cooperativa.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('3354', 'Aquisição de serviço de transporte por estabelecimento de prestador de serviço de comunicação', 'Classificam-se neste código as aquisições de serviços de transporte utilizados por estabelecimento prestador de serviços de comunicação.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('3355', 'Aquisição de serviço de transporte por estabelecimento de geradora ou de distribuidora de energia elétrica', 'Classificam-se neste código as aquisições de serviços de transporte utilizados por estabelecimento de geradora ou de distribuidora de energia elétrica.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('3356', 'Aquisição de serviço de transporte por estabelecimento de produtor rural', 'Classificam-se neste código as aquisições de serviços de transporte utilizados por estabelecimento de produtor rural.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('3500', 'ENTRADAS DE MERCADORIAS REMETIDAS COM FIM ESPECÍFICO DE EXPORTAÇÃO E EVENTUAIS DEVOLUÇÕES', NULL);
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('3503', 'Devolução de mercadoria exportada que tenha sido recebida com fim específico de exportação', 'Classificam-se neste código as devoluções de mercadorias exportadas por “trading company”, empresa comercial exportadora ou outro estabelecimento do remetente, recebidas com fim específico de exportação, cujas saídas tenham sido classificadas no código “7.501 - Exportação de mercadorias recebidas com fim específico de exportação”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('3550', 'OPERAÇÕES COM BENS DE ATIVO IMOBILIZADO E MATERIAIS PARA USO OU CONSUMO', NULL);
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('3551', 'Compra de bem para o ativo imobilizado', 'Classificam-se neste código as compras de bens destinados ao ativo imobilizado do estabelecimento.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('3553', 'Devolução de venda de bem do ativo imobilizado', 'Classificam-se neste código as devoluções de vendas de bens do ativo imobilizado, cujas saídas tenham sido classificadas no código “7.551 - Venda de bem do ativo imobilizado”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('3556', 'Compra de material para uso ou consumo', 'Classificam-se neste código as compras de mercadorias destinadas ao uso ou consumo do estabelecimento.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('3900', 'OUTRAS ENTRADAS DE MERCADORIAS OU AQUISIÇÕES DE SERVIÇOS', NULL);
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('3930', 'Lançamento efetuado a título de entrada de bem sob amparo de regime especial aduaneiro de admissão temporária', 'Classificam-se neste código os lançamentos efetuados a título de entrada de bens amparada por regime especial aduaneiro de admissão temporária.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('3949', 'Outra entrada de mercadoria ou prestação de serviço não especificado', 'Classificam-se neste código as outras entradas de mercadorias ou prestações de serviços que não tenham sido especificados nos códigos anteriores.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5000', 'SAÍDAS OU PRESTAÇÕES DE SERVIÇOS PARA O ESTADO', 'Classificam-se, neste grupo, as operações ou prestações em que o estabelecimento remetente esteja localizado na mesma unidade da Federação do destinatário.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5100', 'VENDAS DE PRODUÇÃO PRÓPRIA OU DE TERCEIROS', NULL);
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5101', 'Venda de produção do estabelecimento', 'Classificam-se neste código as vendas de produtos industrializados no estabelecimento. Também serão classificadas neste código as vendas de mercadorias por estabelecimento industrial de cooperativa destinadas a seus cooperados ou a estabelecimento de outra cooperativa.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5102', 'Venda de mercadoria adquirida ou recebida de terceiros', 'Classificam-se neste código as vendas de mercadorias adquiridas ou recebidas de terceiros para industrialização ou comercialização, que não tenham sido objeto de qualquer processo industrial no estabelecimento. Também serão classificadas neste código as vendas de mercadorias por estabelecimento comercial de cooperativa destinadas a seus cooperados ou estabelecimento de outra cooperativa.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5103', 'Venda de produção do estabelecimento, efetuada fora do estabelecimento', 'Classificam-se neste código as vendas efetuadas fora do estabelecimento, inclusive por meio de veículo, de produtos industrializados no estabelecimento.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5104', 'Venda de mercadoria adquirida ou recebida de terceiros, efetuada fora do estabelecimento', 'Classificam-se neste código as vendas efetuadas fora do estabelecimento, inclusive por meio de veículo, de mercadorias adquiridas ou recebidas de terceiros para industrialização ou comercialização, que não tenham sido objeto de qualquer processo industrial no estabelecimento.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5105', 'Venda de produção do estabelecimento que não deva por ele transitar', 'Classificam-se neste código as vendas de produtos industrializados no estabelecimento, armazenados em depósito fechado, armazém geral ou outro sem que haja retorno ao estabelecimento depositante.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5106', 'Venda de mercadoria adquirida ou recebida de terceiros, que não deva por ele transitar', 'Classificam-se neste código as vendas de mercadorias adquiridas ou recebidas de terceiros para industrialização ou comercialização, armazenadas em depósito fechado, armazém geral ou outro, que não tenham sido objeto de qualquer processo industrial no estabelecimento sem que haja retorno ao estabelecimento depositante. Também serão classificadas neste código as vendas de mercadorias importadas, cuja saída ocorra do recinto alfandegado ou da repartição alfandegária onde se processou o desembaraço aduaneiro, com destino ao estabelecimento do comprador, sem transitar pelo estabelecimento do importador.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5109', 'Venda de produção do estabelecimento, destinada à Zona Franca de Manaus ou Áreas de Livre Comércio', 'Classificam-se neste código as vendas de produtos industrializados pelo estabelecimento, destinados à Zona Franca de Manaus ou Áreas de Livre Comércio.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5110', 'Venda de mercadoria adquirida ou recebida de terceiros, destinada à Zona Franca de Manaus ou Áreas de Livre Comércio', 'Classificam-se neste código as vendas de mercadorias adquiridas ou recebidas de terceiros, que não tenham sido objeto de qualquer processo industrial no estabelecimento, destinadas à Zona Franca de Manaus ou Áreas de Livre Comércio.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5111', 'Venda de produção do estabelecimento remetida anteriormente em consignação industrial', 'Classificam-se neste código as vendas efetivas de produtos industrializados no estabelecimento remetidos anteriormente a título de consignação industrial.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5112', 'Venda de mercadoria adquirida ou recebida de terceiros remetida anteriormente em consignação industrial', 'Classificam-se neste código as vendas efetivas de mercadorias adquiridas ou recebidas de terceiros, que não tenham sido objeto de qualquer processo industrial no estabelecimento, remetidas anteriormente a título de consignação industrial.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5113', 'Venda de produção do estabelecimento remetida anteriormente em consignação mercantil', 'Classificam-se neste código as vendas efetivas de produtos industrializados no estabelecimento remetidos anteriormente a título de consignação mercantil.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5114', 'Venda de mercadoria adquirida ou recebida de terceiros remetida anteriormente em consignação mercantil', 'Classificam-se neste código as vendas efetivas de mercadorias adquiridas ou recebidas de terceiros, que não tenham sido objeto de qualquer processo industrial no estabelecimento, remetidas anteriormente a título de consignação mercantil.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5115', 'Venda de mercadoria adquirida ou recebida de terceiros, recebida anteriormente em consignação mercantil', 'Classificam-se neste código as vendas de mercadorias adquiridas ou recebidas de terceiros, recebidas anteriormente a título de consignação mercantil.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5116', 'Venda de produção do estabelecimento originada de encomenda para entrega futura', 'Classificam-se neste código as vendas de produtos industrializados pelo estabelecimento, quando da saída real do produto, cujo faturamento tenha sido classificado no código “5.922 - Lançamento efetuado a título de simples faturamento decorrente de venda para entrega futura”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5117', 'Venda de mercadoria adquirida ou recebida de terceiros, originada de encomenda para entrega futura', 'Classificam-se neste código as vendas de mercadorias adquiridas ou recebidas de terceiros, que não tenham sido objeto de qualquer processo industrial no estabelecimento, quando da saída real da mercadoria, cujo faturamento tenha sido classificado no código “5.922 - Lançamento efetuado a título de simples faturamento decorrente de venda para entrega futura”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5118', 'Venda de produção do estabelecimento entregue ao destinatário por conta e ordem do adquirente originário, em venda à ordem', 'Classificam-se neste código as vendas à ordem de produtos industrializados pelo estabelecimento, entregues ao destinatário por conta e ordem do adquirente originário.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5119', 'Venda de mercadoria adquirida ou recebida de terceiros entregue ao destinatário por conta e ordem do adquirente originário, em venda à ordem', 'Classificam-se neste código as vendas à ordem de mercadorias adquiridas ou recebidas de terceiros, que não tenham sido objeto de qualquer processo industrial no estabelecimento, entregues ao destinatário por conta e ordem do adquirente originário.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5120', 'Venda de mercadoria adquirida ou recebida de terceiros entregue ao destinatário pelo vendedor remetente, em venda à ordem', 'Classificam-se neste código as vendas à ordem de mercadorias adquiridas ou recebidas de terceiros, que não tenham sido objeto de qualquer processo industrial no estabelecimento, entregues pelo vendedor remetente ao destinatário, cuja compra seja classificada, pelo adquirente originário, no código “1.118 - Compra de mercadoria para comercialização pelo adquirente originário, entregue pelo vendedor remetente ao destinatário, em venda à ordem”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5122', 'Venda de produção do estabelecimento remetida para industrialização, por conta e ordem do adquirente, sem transitar pelo estabelecimento do adquirente', 'Classificam-se neste código as vendas de produtos industrializados no estabelecimento, remetidos para serem industrializados em outro estabelecimento, por conta e ordem do adquirente, sem que os produtos tenham transitado pelo estabelecimento do adquirente.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5123', 'Venda de mercadoria adquirida ou recebida de terceiros remetida para industrialização, por conta e ordem do adquirente, sem transitar pelo estabelecimento do adquirente', 'Classificam-se neste código as vendas de mercadorias adquiridas ou recebidas de terceiros, que não tenham sido objeto de qualquer processo industrial no estabelecimento, remetidas para serem industrializadas em outro estabelecimento, por conta e ordem do adquirente, sem que as mercadorias tenham transitado pelo estabelecimento do adquirente.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5124', 'Industrialização efetuada para outra empresa', 'Classificam-se neste código as saídas de mercadorias industrializadas para terceiros, compreendendo os valores referentes aos serviços prestados e os das mercadorias de propriedade do industrializador empregadas no processo industrial.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5125', 'Industrialização efetuada para outra empresa quando a mercadoria recebida para utilização no processo de industrialização não transitar pelo estabelecimento adquirente da mercadoria', 'Classificam-se neste código as saídas de mercadorias industrializadas para outras empresas, em que as mercadorias recebidas para utilização no processo de industrialização não tenham transitado pelo estabelecimento do adquirente das mercadorias, compreendendo os valores referentes aos serviços prestados e os das mercadorias de propriedade do industrializador empregadas no processo industrial.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5150', 'TRANSFERÊNCIAS DE PRODUÇÃO PRÓPRIA OU DE TERCEIROS', NULL);
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5151', 'Transferência de produção do estabelecimento', 'Classificam-se neste código os produtos industrializados no estabelecimento e transferidos para outro estabelecimento da mesma empresa.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5152', 'Transferência de mercadoria adquirida ou recebida de terceiros', 'Classificam-se neste código as mercadorias adquiridas ou recebidas de terceiros para industrialização ou comercialização e que não tenham sido objeto de qualquer processo industrial no estabelecimento, transferidas para outro estabelecimento da mesma empresa.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5153', 'Transferência de energia elétrica', 'Classificam-se neste código as transferências de energia elétrica para outro estabelecimento da mesma empresa, para distribuição.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5155', 'Transferência de produção do estabelecimento, que não deva por ele transitar', 'Classificam-se neste código as transferências para outro estabelecimento da mesma empresa, de produtos industrializados no estabelecimento que tenham sido remetidos para armazém geral, depósito fechado ou outro, sem que haja retorno ao estabelecimento depositante.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5156', 'Transferência de mercadoria adquirida ou recebida de terceiros, que não deva por ele transitar', 'Classificam-se neste código as transferências para outro estabelecimento da mesma empresa, de mercadorias adquiridas ou recebidas de terceiros para industrialização ou comercialização, que não tenham sido objeto de qualquer processo industrial, remetidas para armazém geral, depósito fechado ou outro, sem que haja retorno ao estabelecimento depositante.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5200', 'DEVOLUÇÕES DE COMPRAS PARA INDUSTRIALIZAÇÃO, COMERCIALIZAÇÃO OU ANULAÇÕES DE VALORES', NULL);
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5201', 'Devolução de compra para industrialização', 'Classificam-se neste código as devoluções de mercadorias adquiridas para serem utilizadas em processo de industrialização, cujas entradas tenham sido classificadas como “Compra para industrialização”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5202', 'Devolução de compra para comercialização', 'Classificam-se neste código as devoluções de mercadorias adquiridas para serem comercializadas, cujas entradas tenham sido classificadas como “Compra para comercialização”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5205', 'Anulação de valor relativo a aquisição de serviço de comunicação', 'Classificam-se neste código as anulações correspondentes a valores faturados indevidamente, decorrentes das aquisições de serviços de comunicação.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5206', 'Anulação de valor relativo a aquisição de serviço de transporte', 'Classificam-se neste código as anulações correspondentes a valores faturados indevidamente, decorrentes das aquisições de serviços de transporte.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5207', 'Anulação de valor relativo à compra de energia elétrica', 'Classificam-se neste código as anulações correspondentes a valores faturados indevidamente, decorrentes da compra de energia elétrica.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5208', 'Devolução de mercadoria recebida em transferência para industrialização', 'Classificam-se neste código as devoluções de mercadorias recebidas em transferência de outros estabelecimentos da mesma empresa, para serem utilizadas em processo de industrialização.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5209', 'Devolução de mercadoria recebida em transferência para comercialização', 'Classificam-se neste código as devoluções de mercadorias recebidas em transferência de outro estabelecimento da mesma empresa, para serem comercializadas.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5210', 'Devolução de compra para utilização na prestação de serviço', 'Classificam-se neste código as devoluções de mercadorias adquiridas para utilização na prestação de serviços, cujas entradas tenham sido classificadas no código “1.126 - Compra para utilização na prestação de serviço”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5250', 'VENDAS DE ENERGIA ELÉTRICA', NULL);
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5251', 'Venda de energia elétrica para distribuição ou comercialização', 'Classificam-se neste código as vendas de energia elétrica destinada à distribuição ou comercialização. Também serão classificadas neste código as vendas de energia elétrica destinada a cooperativas para distribuição aos seus cooperados.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5252', 'Venda de energia elétrica para estabelecimento industrial', 'Classificam-se neste código as vendas de energia elétrica para consumo por estabelecimento industrial. Também serão classificadas neste código as vendas de energia elétrica destinada a estabelecimento industrial de cooperativa.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5253', 'Venda de energia elétrica para estabelecimento comercial', 'Classificam-se neste código as vendas de energia elétrica para consumo por estabelecimento comercial. Também serão classificadas neste código as vendas de energia elétrica destinada a estabelecimento comercial de cooperativa.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5254', 'Venda de energia elétrica para estabelecimento prestador de serviço de transporte', 'Classificam-se neste código as vendas de energia elétrica para consumo por estabelecimento de prestador de serviços de transporte.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5255', 'Venda de energia elétrica para estabelecimento prestador de serviço de comunicação', 'Classificam-se neste código as vendas de energia elétrica para consumo por estabelecimento de prestador de serviços de comunicação.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5256', 'Venda de energia elétrica para estabelecimento de produtor rural', 'Classificam-se neste código as vendas de energia elétrica para consumo por estabelecimento de produtor rural.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5257', 'Venda de energia elétrica para consumo por demanda contratada', 'Classificam-se neste código as vendas de energia elétrica para consumo por demanda contratada, que prevalecerá sobre os demais códigos deste subgrupo.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5258', 'Venda de energia elétrica a não-contribuinte', 'Classificam-se neste código as vendas de energia elétrica a pessoas físicas ou a pessoas jurídicas não indicadas nos códigos anteriores.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5300', 'PRESTAÇÕES DE SERVIÇOS DE COMUNICAÇÃO', NULL);
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5301', 'Prestação de serviço de comunicação para execução de serviço da mesma natureza', 'Classificam-se neste código as prestações de serviços de comunicação destinados às prestações de serviços da mesma natureza.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5302', 'Prestação de serviço de comunicação a estabelecimento industrial', 'Classificam-se neste código as prestações de serviços de comunicação a estabelecimento industrial. Também serão classificados neste código os serviços de comunicação prestados a estabelecimento industrial de cooperativa.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5303', 'Prestação de serviço de comunicação a estabelecimento comercial', 'Classificam-se neste código as prestações de serviços de comunicação a estabelecimento comercial. Também serão classificados neste código os serviços de comunicação prestados a estabelecimento comercial de cooperativa.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5304', 'Prestação de serviço de comunicação a estabelecimento de prestador de serviço de transporte', 'Classificam-se neste código as prestações de serviços de comunicação a estabelecimento prestador de serviço de transporte.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5305', 'Prestação de serviço de comunicação a estabelecimento de geradora ou de distribuidora de energia elétrica', 'Classificam-se neste código as prestações de serviços de comunicação a estabelecimento de geradora ou de distribuidora de energia elétrica.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5306', 'Prestação de serviço de comunicação a estabelecimento de produtor rural', 'Classificam-se neste código as prestações de serviços de comunicação a estabelecimento de produtor rural.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5307', 'Prestação de serviço de comunicação a não-contribuinte', 'Classificam-se neste código as prestações de serviços de comunicação a pessoas físicas ou a pessoas jurídicas não indicadas nos códigos anteriores.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5350', 'PRESTAÇÕES DE SERVIÇOS DE TRANSPORTE', NULL);
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5351', 'Prestação de serviço de transporte para execução de serviço da mesma natureza', 'Classificam-se neste código as prestações de serviços de transporte destinados às prestações de serviços da mesma natureza.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5352', 'Prestação de serviço de transporte a estabelecimento industrial', 'Classificam-se neste código as prestações de serviços de transporte a estabelecimento industrial. Também serão classificados neste código os serviços de transporte prestados a estabelecimento industrial de cooperativa.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5353', 'Prestação de serviço de transporte a estabelecimento comercial', 'Classificam-se neste código as prestações de serviços de transporte a estabelecimento comercial. Também serão classificados neste código os serviços de transporte prestados a estabelecimento comercial de cooperativa.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5354', 'Prestação de serviço de transporte a estabelecimento de prestador de serviço de comunicação', 'Classificam-se neste código as prestações de serviços de transporte a estabelecimento prestador de serviços de comunicação.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5355', 'Prestação de serviço de transporte a estabelecimento de geradora ou de distribuidora de energia elétrica', 'Classificam-se neste código as prestações de serviços de transporte a estabelecimento de geradora ou de distribuidora de energia elétrica.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5356', 'Prestação de serviço de transporte a estabelecimento de produtor rural', 'Classificam-se neste código as prestações de serviços de transporte a estabelecimento de produtor rural.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5357', 'Prestação de serviço de transporte a não-contribuinte', 'Classificam-se neste código as prestações de serviços de transporte a pessoas físicas ou a pessoas jurídicas não indicadas nos códigos anteriores.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5400', 'SAÍDAS DE MERCADORIAS SUJEITAS AO REGIME DE SUBSTITUIÇÃO TRIBUTÁRIA', NULL);
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5401', 'Venda de produção do estabelecimento em operação com produto sujeito ao regime de substituição tributária, na condição de contribuinte substituto', 'Classificam-se neste código as vendas de produtos industrializados no estabelecimento em operações com produtos sujeitos ao regime de substituição tributária, na condição de contribuinte substituto. Também serão classificadas neste código as vendas de produtos industrializados por estabelecimento industrial de cooperativa sujeitos ao regime de substituição tributária, na condição de contribuinte substituto.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5402', 'Venda de produção do estabelecimento de produto sujeito ao regime de substituição tributária, em operação entre contribuintes substitutos do mesmo produto', 'Classificam-se neste código as vendas de produtos sujeitos ao regime de substituição tributária industrializados no estabelecimento, em operações entre contribuintes substitutos do mesmo produto.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5403', 'Venda de mercadoria adquirida ou recebida de terceiros em operação com mercadoria sujeita ao regime de substituição tributária, na condição de contribuinte substituto', 'Classificam-se neste código as vendas de mercadorias adquiridas ou recebidas de terceiros, na condição de contribuinte substituto, em operação com mercadorias sujeitas ao regime de substituição tributária.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5405', 'Venda de mercadoria adquirida ou recebida de terceiros em operação com mercadoria sujeita ao regime de substituição tributária, na condição de contribuinte substituído', 'Classificam-se neste código as vendas de mercadorias adquiridas ou recebidas de terceiros em operação com mercadorias sujeitas ao regime de substituição tributária, na condição de contribuinte substituído.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5408', 'Transferência de produção do estabelecimento em operação com produto sujeito ao regime de substituição tributária', 'Classificam-se neste código os produtos industrializados no estabelecimento e transferidos para outro estabelecimento da mesma empresa, em operações com produtos sujeitos ao regime de substituição tributária.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5409', 'Transferência de mercadoria adquirida ou recebida de terceiros em operação com mercadoria sujeita ao regime de substituição tributária', 'Classificam-se neste código as transferências para outro estabelecimento da mesma empresa, de mercadorias adquiridas ou recebidas de terceiros que não tenham sido objeto de qualquer processo industrial no estabelecimento, em operações com mercadorias sujeitas ao regime de substituição tributária.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5410', 'Devolução de compra para industrialização em operação com mercadoria sujeita ao regime de substituição tributária', 'Classificam-se neste código as devoluções de mercadorias adquiridas para serem utilizadas em processo de industrialização cujas entradas tenham sido classificadas como “Compra para industrialização em operação com mercadoria sujeita ao regime de substituição tributária”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5411', 'Devolução de compra para comercialização em operação com mercadoria sujeita ao regime de substituição tributária', 'Classificam-se neste código as devoluções de mercadorias adquiridas para serem comercializadas, cujas entradas tenham sido classificadas como “Compra para comercialização em operação com mercadoria sujeita ao regime de substituição tributária”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5412', 'Devolução de bem do ativo imobilizado, em operação com mercadoria sujeita ao regime de substituição tributária', 'Classificam-se neste código as devoluções de bens adquiridos para integrar o ativo imobilizado do estabelecimento, cuja entrada tenha sido classificada no código “1.406 - Compra de bem para o ativo imobilizado cuja mercadoria está sujeita ao regime de substituição tributária”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5413', 'Devolução de mercadoria destinada ao uso ou consumo, em operação com mercadoria sujeita ao regime de substituição tributária', 'Classificam-se neste código as devoluções de mercadorias adquiridas para uso ou consumo do estabelecimento, cuja entrada tenha sido classificada no código “1.407 - Compra de mercadoria para uso ou consumo cuja mercadoria está sujeita ao regime de substituição tributária”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5414', 'Remessa de produção do estabelecimento para venda fora do estabelecimento em operação com produto sujeito ao regime de substituição tributária', 'Classificam-se neste código as remessas de produtos industrializados pelo estabelecimento para serem vendidos fora do estabelecimento, inclusive por meio de veículos, em operações com produtos sujeitos ao regime de substituição tributária.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5415', 'Remessa de mercadoria adquirida ou recebida de terceiros para venda fora do estabelecimento, em operação com mercadoria sujeita ao regime de substituição tributária', 'Classificam-se neste código as remessas de mercadorias adquiridas ou recebidas de terceiros para serem vendidas fora do estabelecimento, inclusive por meio de veículos, em operações com mercadorias sujeitas ao regime de substituição tributária.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5450', 'SISTEMAS DE INTEGRAÇÃO', NULL);
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5451', 'Remessa de animal e de insumo para estabelecimento produtor', 'Classificam-se neste código as saídas referentes à remessa de animais e de insumos para criação de animais no sistema integrado, tais como: pintos, leitões, rações e medicamentos.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5500', 'REMESSAS COM FIM ESPECÍFICO DE EXPORTAÇÃO E EVENTUAIS DEVOLUÇÕES', NULL);
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5501', 'Remessa de produção do estabelecimento, com fim específico de exportação', 'Classificam-se neste código as saídas de produtos industrializados pelo estabelecimento, remetidos com fim específico de exportação a “trading company”, empresa comercial exportadora ou outro estabelecimento do remetente.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5502', 'Remessa de mercadoria adquirida ou recebida de terceiros, com fim específico de exportação', 'Classificam-se neste código as saídas de mercadorias adquiridas ou recebidas de terceiros, remetidas com fim específico de exportação a “trading company”, empresa comercial exportadora ou outro estabelecimento do remetente.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5503', 'Devolução de mercadoria recebida com fim específico de exportação', 'Classificam-se neste código as devoluções efetuadas por “trading company”, empresa comercial exportadora ou outro estabelecimento do destinatário, de mercadorias recebidas com fim específico de exportação, cujas entradas tenham sido classificadas no código “1.501 - Entrada de mercadoria recebida com fim específico de exportação”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5550', 'OPERAÇÕES COM BENS DE ATIVO IMOBILIZADO E MATERIAIS PARA USO OU CONSUMO', NULL);
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5551', 'Venda de bem do ativo imobilizado', 'Classificam-se neste código as vendas de bens integrantes do ativo imobilizado do estabelecimento.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5552', 'Transferência de bem do ativo imobilizado', 'Classificam-se neste código os bens do ativo imobilizado transferidos para outro estabelecimento da mesma empresa.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5553', 'Devolução de compra de bem para o ativo imobilizado', 'Classificam-se neste código as devoluções de bens adquiridos para integrar o ativo imobilizado do estabelecimento, cuja entrada foi classificada no código “1.551 - Compra de bem para o ativo imobilizado”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5554', 'Remessa de bem do ativo imobilizado para uso fora do estabelecimento', 'Classificam-se neste código as remessas de bens do ativo imobilizado para uso fora do estabelecimento.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5555', 'Devolução de bem do ativo imobilizado de terceiro, recebido para uso no estabelecimento', 'Classificam-se neste código as saídas em devolução, de bens do ativo imobilizado de terceiros, recebidos para uso no estabelecimento, cuja entrada tenha sido classificada no código “1.555 - Entrada de bem do ativo imobilizado de terceiro, remetido para uso no estabelecimento”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5556', 'Devolução de compra de material de uso ou consumo', 'Classificam-se neste código as devoluções de mercadorias destinadas ao uso ou consumo do estabelecimento, cuja entrada tenha sido classificada no código “1.556 - Compra de material para uso ou consumo”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5557', 'Transferência de material de uso ou consumo', 'Classificam-se neste código os materiais para uso ou consumo transferidos para outro estabelecimento da mesma empresa.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5600', 'CRÉDITOS E RESSARCIMENTOS DE ICMS', NULL);
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5601', 'Transferência de crédito de ICMS acumulado', 'Classificam-se neste código os lançamentos destinados ao registro da transferência de créditos de ICMS para outras empresas.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5602', 'Transferência de saldo credor de ICMS para outro estabelecimento da mesma empresa, destinado à compensação de saldo devedor de ICMS', 'Classificam-se neste código os lançamentos destinados ao registro da transferência de saldos credores de ICMS para outros estabelecimentos da mesma empresa, destinados à compensação do saldo devedor desses estabelecimentos.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5603', 'Ressarcimento de ICMS retido por substituição tributária', 'Classificam-se neste código os lançamentos destinados ao registro de ressarcimento de ICMS retido por substituição tributária a contribuinte substituído, efetuado pelo contribuinte substituto, nas hipóteses previstas na legislação aplicável.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5900', 'OUTRAS SAÍDAS DE MERCADORIAS OU PRESTAÇÕES DE SERVIÇOS', NULL);
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5901', 'Remessa para industrialização por encomenda', 'Classificam-se neste código as remessas de insumos remetidos para industrialização por encomenda, a ser realizada em outra empresa ou em outro estabelecimento da mesma empresa.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5902', 'Retorno de mercadoria utilizada na industrialização por encomenda', 'Classificam-se neste código as remessas, pelo estabelecimento industrializador, dos insumos recebidos para industrialização e incorporados ao produto final, por encomenda de outra empresa ou de outro estabelecimento da mesma empresa. O valor dos insumos nesta operação deverá ser igual ao valor dos insumos recebidos para industrialização.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5903', 'Retorno de mercadoria recebida para industrialização e não aplicada no referido processo', 'Classificam-se neste código as remessas em devolução de insumos recebidos para industrialização e não aplicados no referido processo.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5904', 'Remessa para venda fora do estabelecimento', 'Classificam-se neste código as remessas de mercadorias para venda fora do estabelecimento, inclusive por meio de veículos.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5905', 'Remessa para depósito fechado ou armazém geral', 'Classificam-se neste código as remessas de mercadorias para depósito em depósito fechado ou armazém geral.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5906', 'Retorno de mercadoria depositada em depósito fechado ou armazém geral', 'Classificam-se neste código os retornos de mercadorias depositadas em depósito fechado ou armazém geral ao estabelecimento depositante.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5907', 'Retorno simbólico de mercadoria depositada em depósito fechado ou armazém geral', 'Classificam-se neste código os retornos simbólicos de mercadorias recebidas para depósito em depósito fechado ou armazém geral, quando as mercadorias depositadas tenham sido objeto de saída a qualquer título e que não devam retornar ao estabelecimento depositante.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5908', 'Remessa de bem por conta de contrato de comodato', 'Classificam-se neste código as remessas de bens para o cumprimento de contrato de comodato.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5909', 'Retorno de bem recebido por conta de contrato de comodato', 'Classificam-se neste código as remessas de bens em devolução após cumprido o contrato de comodato.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5910', 'Remessa em bonificação, doação ou brinde', 'Classificam-se neste código as remessas de mercadorias a título de bonificação, doação ou brinde.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5911', 'Remessa de amostra grátis', 'Classificam-se neste código as remessas de mercadorias a título de amostra grátis.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5912', 'Remessa de mercadoria ou bem para demonstração', 'Classificam-se neste código as remessas de mercadorias ou bens para demonstração.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5913', 'Retorno de mercadoria ou bem recebido para demonstração', 'Classificam-se neste código as remessas em devolução de mercadorias ou bens recebidos para demonstração.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5914', 'Remessa de mercadoria ou bem para exposição ou feira', 'Classificam-se neste código as remessas de mercadorias ou bens para exposição ou feira.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5915', 'Remessa de mercadoria ou bem para conserto ou reparo', 'Classificam-se neste código as remessas de mercadorias ou bens para conserto ou reparo.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5916', 'Retorno de mercadoria ou bem recebido para conserto ou reparo', 'Classificam-se neste código as remessas em devolução de mercadorias ou bens recebidos para conserto ou reparo.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5917', 'Remessa de mercadoria em consignação mercantil ou industrial', 'Classificam-se neste código as remessas de mercadorias a título de consignação mercantil ou industrial.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5918', 'Devolução de mercadoria recebida em consignação mercantil ou industrial', 'Classificam-se neste código as devoluções de mercadorias recebidas anteriormente a título de consignação mercantil ou industrial.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5919', 'Devolução simbólica de mercadoria vendida ou utilizada em processo industrial, recebida anteriormente em consignação mercantil ou industrial', 'Classificam-se neste código as devoluções simbólicas de mercadorias vendidas ou utilizadas em processo industrial, que tenham sido recebidas anteriormente a título de consignação mercantil ou industrial.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5920', 'Remessa de vasilhame ou sacaria', 'Classificam-se neste código as remessas de vasilhame ou sacaria.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5921', 'Devolução de vasilhame ou sacaria', 'Classificam-se neste código as saídas por devolução de vasilhame ou sacaria.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5922', 'Lançamento efetuado a título de simples faturamento decorrente de venda para entrega futura', 'Classificam-se neste código os registros efetuados a título de simples faturamento decorrente de venda para entrega futura.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5923', 'Remessa de mercadoria por conta e ordem de terceiros, em venda à ordem', 'Classificam-se neste código as saídas correspondentes à entrega de mercadorias por conta e ordem de terceiros, em vendas à ordem, cuja venda ao adquirente originário, foi classificada nos códigos “5.118 - Venda de produção do estabelecimento entregue ao destinatário por conta e ordem do adquirente originário, em venda à ordem” ou “5.119 - Venda de mercadoria adquirida ou recebida de terceiros entregue ao destinatário por conta e ordem do adquirente originário, em venda à ordem”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5924', 'Remessa para industrialização por conta e ordem do adquirente da mercadoria, quando esta não transitar pelo estabelecimento do adquirente', 'Classificam-se neste código as saídas de insumos com destino a estabelecimento industrializador, para serem industrializados por conta e ordem do adquirente, nas hipóteses em que os insumos não tenham transitado pelo estabelecimento do adquirente dos mesmos.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5925', 'Retorno de mercadoria recebida para industrialização por conta e ordem do adquirente da mercadoria, quando aquela não transitar pelo estabelecimento do adquirente', 'Classificam-se neste código as remessas, pelo estabelecimento industrializador, dos insumos recebidos, por conta e ordem do adquirente, para industrialização e incorporados ao produto final, nas hipóteses em que os insumos não tenham transitado pelo estabelecimento do adquirente. O valor dos insumos nesta operação deverá ser igual ao valor dos insumos recebidos para industrialização.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5926', 'Lançamento efetuado a título de reclassificação de mercadoria decorrente de formação de kit ou de sua desagregação', 'Classificam-se neste código os registros efetuados a título de reclassificação decorrente de formação de kit de mercadorias ou de sua desagregação.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5927', 'Lançamento efetuado a título de baixa de estoque decorrente de perda, roubo ou deterioração', 'Classificam-se neste código os registros efetuados a título de baixa de estoque decorrente de perda, roubo ou deterioração das mercadorias.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5928', 'Lançamento efetuado a título de baixa de estoque decorrente do encerramento da atividade da empresa', 'Classificam-se neste código os registros efetuados a título de baixa de estoque decorrente do encerramento das atividades da empresa.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5929', 'Lançamento efetuado em decorrência de emissão de documento fiscal relativo a operação ou prestação também registrada em equipamento Emissor de Cupom Fiscal - ECF', 'Classificam-se neste código os registros relativos aos documentos fiscais emitidos em operações ou prestações que também tenham sido registradas em equipamento Emissor de Cupom Fiscal - ECF.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5931', 'Lançamento efetuado em decorrência da respons. de retenção do imposto por subst. tributária, atribuída ao rem. ou alienante da merc., pelo serv. de transp. realizado por transp. autônomo ou por transp. não inscrito na UF onde iniciado o serviço', 'Classificam-se neste código exclusivamente os lançamentos efetuados pelo remetente ou alienante da mercadoria quando lhe for atribuída a responsabilidade pelo recolhimento do imposto devido pelo serviço de transporte realizado por transportador autônomo ou por transportador não inscrito na unidade da Federação onde iniciado o serviço.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5932', 'Prestação de serviço de transporte iniciada em unidade da Federação diversa daquela onde inscrito o prestador', 'Classificam-se neste código as prestações de serviço de transporte que tenham sido iniciadas em unidade da Federação diversa daquela onde o prestador está inscrito como contribuinte.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('5949', 'Outra saída de mercadoria ou prestação de serviço não especificado', 'Classificam-se neste código as outras saídas de mercadorias ou prestações de serviços que não tenham sido especificados nos códigos anteriores.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6000', 'SAÍDAS OU PRESTAÇÕES DE SERVIÇOS PARA OUTROS ESTADOS', 'Classificam-se, neste grupo, as operações ou prestações em que o estabelecimento remetente esteja localizado em unidade da Federação diversa daquela do destinatário.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6100', 'VENDAS DE PRODUÇÃO PRÓPRIA OU DE TERCEIROS', NULL);
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6101', 'Venda de produção do estabelecimento', 'Classificam-se neste código as vendas de produtos industrializados no estabelecimento. Também serão classificadas neste código as vendas de mercadorias por estabelecimento industrial de cooperativa destinadas a seus cooperados ou a estabelecimento de outra cooperativa.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6102', 'Venda de mercadoria adquirida ou recebida de terceiros', 'Classificam-se neste código as vendas de mercadorias adquiridas ou recebidas de terceiros para industrialização ou comercialização, que não tenham sido objeto de qualquer processo industrial no estabelecimento. Também serão classificadas neste código as vendas de mercadorias por estabelecimento comercial de cooperativa destinadas a seus cooperados ou estabelecimento de outra cooperativa.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6103', 'Venda de produção do estabelecimento, efetuada fora do estabelecimento', 'Classificam-se neste código as vendas efetuadas fora do estabelecimento, inclusive por meio de veículo, de produtos industrializados no estabelecimento.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6104', 'Venda de mercadoria adquirida ou recebida de terceiros, efetuada fora do estabelecimento', 'Classificam-se neste código as vendas efetuadas fora do estabelecimento, inclusive por meio de veículo, de mercadorias adquiridas ou recebidas de terceiros para industrialização ou comercialização, que não tenham sido objeto de qualquer processo industrial no estabelecimento.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6105', 'Venda de produção do estabelecimento que não deva por ele transitar', 'Classificam-se neste código as vendas de produtos industrializados no estabelecimento, armazenados em depósito fechado, armazém geral ou outro sem que haja retorno ao estabelecimento depositante.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6106', 'Venda de mercadoria adquirida ou recebida de terceiros, que não deva por ele transitar', 'Classificam-se neste código as vendas de mercadorias adquiridas ou recebidas de terceiros para industrialização ou comercialização, armazenadas em depósito fechado, armazém geral ou outro, que não tenham sido objeto de qualquer processo industrial no estabelecimento sem que haja retorno ao estabelecimento depositante. Também serão classificadas neste código as vendas de mercadorias importadas, cuja saída ocorra do recinto alfandegado ou da repartição alfandegária onde se processou o desembaraço aduaneiro, com destino ao estabelecimento do comprador, sem transitar pelo estabelecimento do importador.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6107', 'Venda de produção do estabelecimento, destinada a não-contribuinte', 'Classificam-se neste código as vendas de produtos industrializados no estabelecimento, destinadas a não-contribuintes. Quaisquer operações de venda destinadas a não-contribuintes deverão ser classificadas neste código.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6108', 'Venda de mercadoria adquirida ou recebida de terceiros, destinada a não-contribuinte', 'Classificam-se neste código as vendas de mercadorias adquiridas ou recebidas de terceiros para industrialização ou comercialização, que não tenham sido objeto de qualquer processo industrial no estabelecimento, destinadas a não-contribuintes. Quaisquer operações de venda destinadas a não-contribuintes deverão ser classificadas neste código.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6109', 'Venda de produção do estabelecimento, destinada à Zona Franca de Manaus ou Áreas de Livre Comércio', 'Classificam-se neste código as vendas de produtos industrializados pelo estabelecimento, destinados à Zona Franca de Manaus ou Áreas de Livre Comércio.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6110', 'Venda de mercadoria adquirida ou recebida de terceiros, destinada à Zona Franca de Manaus ou Áreas de Livre Comércio', 'Classificam-se neste código as vendas de mercadorias adquiridas ou recebidas de terceiros, que não tenham sido objeto de qualquer processo industrial no estabelecimento, destinadas à Zona Franca de Manaus ou Áreas de Livre Comércio.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6111', 'Venda de produção do estabelecimento remetida anteriormente em consignação industrial', 'Classificam-se neste código as vendas efetivas de produtos industrializados no estabelecimento remetidos anteriormente a título de consignação industrial.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6112', 'Venda de mercadoria adquirida ou recebida de terceiros remetida anteriormente em consignação industrial', 'Classificam-se neste código as vendas efetivas de mercadorias adquiridas ou recebidas de terceiros, que não tenham sido objeto de qualquer processo industrial no estabelecimento, remetidas anteriormente a título de consignação industrial.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6113', 'Venda de produção do estabelecimento remetida anteriormente em consignação mercantil', 'Classificam-se neste código as vendas efetivas de produtos industrializados no estabelecimento remetidos anteriormente a título de consignação mercantil.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6114', 'Venda de mercadoria adquirida ou recebida de terceiros remetida anteriormente em consignação mercantil', 'Classificam-se neste código as vendas efetivas de mercadorias adquiridas ou recebidas de terceiros, que não tenham sido objeto de qualquer processo industrial no estabelecimento, remetidas anteriormente a título de consignação mercantil.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6115', 'Venda de mercadoria adquirida ou recebida de terceiros, recebida anteriormente em consignação mercantil', 'Classificam-se neste código as vendas de mercadorias adquiridas ou recebidas de terceiros, recebidas anteriormente a título de consignação mercantil.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6116', 'Venda de produção do estabelecimento originada de encomenda para entrega futura', 'Classificam-se neste código as vendas de produtos industrializados pelo estabelecimento, quando da saída real do produto, cujo faturamento tenha sido classificado no código “6.922 - Lançamento efetuado a título de simples faturamento decorrente de venda para entrega futura”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6117', 'Venda de mercadoria adquirida ou recebida de terceiros, originada de encomenda para entrega futura', 'Classificam-se neste código as vendas de mercadorias adquiridas ou recebidas de terceiros, que não tenham sido objeto de qualquer processo industrial no estabelecimento, quando da saída real da mercadoria, cujo faturamento tenha sido classificado no código “6.922 - Lançamento efetuado a título de simples faturamento decorrente de venda para entrega futura”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6118', 'Venda de produção do estabelecimento entregue ao destinatário por conta e ordem do adquirente originário, em venda à ordem', 'Classificam-se neste código as vendas à ordem de produtos industrializados pelo estabelecimento, entregues ao destinatário por conta e ordem do adquirente originário.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6119', 'Venda de mercadoria adquirida ou recebida de terceiros entregue ao destinatário por conta e ordem do adquirente originário, em venda à ordem', 'Classificam-se neste código as vendas à ordem de mercadorias adquiridas ou recebidas de terceiros, que não tenham sido objeto de qualquer processo industrial no estabelecimento, entregues ao destinatário por conta e ordem do adquirente originário.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6120', 'Venda de mercadoria adquirida ou recebida de terceiros entregue ao destinatário pelo vendedor remetente, em venda à ordem', 'Classificam-se neste código as vendas à ordem de mercadorias adquiridas ou recebidas de terceiros, que não tenham sido objeto de qualquer processo industrial no estabelecimento, entregues pelo vendedor remetente ao destinatário, cuja compra seja classificada, pelo adquirente originário, no código “2.118 - Compra de mercadoria para comercialização pelo adquirente originário, entregue pelo vendedor remetente ao destinatário, em venda à ordem”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6122', 'Venda de produção do estabelecimento remetida para industrialização, por conta e ordem do adquirente, sem transitar pelo estabelecimento do adquirente', 'Classificam-se neste código as vendas de produtos industrializados no estabelecimento, remetidos para serem industrializados em outro estabelecimento, por conta e ordem do adquirente, sem que os produtos tenham transitado pelo estabelecimento do adquirente.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6123', 'Venda de mercadoria adquirida ou recebida de terceiros remetida para industrialização, por conta e ordem do adquirente, sem transitar pelo estabelecimento do adquirente', 'Classificam-se neste código as vendas de mercadorias adquiridas ou recebidas de terceiros, que não tenham sido objeto de qualquer processo industrial no estabelecimento, remetidas para serem industrializadas em outro estabelecimento, por conta e ordem do adquirente, sem que as mercadorias tenham transitado pelo estabelecimento do adquirente.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6124', 'Industrialização efetuada para outra empresa', 'Classificam-se neste código as saídas de mercadorias industrializadas para terceiros, compreendendo os valores referentes aos serviços prestados e os das mercadorias de propriedade do industrializador empregadas no processo industrial.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6125', 'Industrialização efetuada para outra empresa quando a mercadoria recebida para utilização no processo de industrialização não transitar pelo estabelecimento adquirente da mercadoria', 'Classificam-se neste código as saídas de mercadorias industrializadas para outras empresas, em que as mercadorias recebidas para utilização no processo de industrialização não tenham transitado pelo estabelecimento do adquirente das mercadorias, compreendendo os valores referentes aos serviços prestados e os das mercadorias de propriedade do industrializador empregadas no processo industrial.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6150', 'TRANSFERÊNCIAS DE PRODUÇÃO PRÓPRIA OU DE TERCEIROS', NULL);
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6151', 'Transferência de produção do estabelecimento', 'Classificam-se neste código os produtos industrializados no estabelecimento e transferidos para outro estabelecimento da mesma empresa.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6152', 'Transferência de mercadoria adquirida ou recebida de terceiros', 'Classificam-se neste código as mercadorias adquiridas ou recebidas de terceiros para industrialização ou comercialização e que não tenham sido objeto de qualquer processo industrial no estabelecimento, transferidas para outro estabelecimento da mesma empresa.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6153', 'Transferência de energia elétrica', 'Classificam-se neste código as transferências de energia elétrica para outro estabelecimento da mesma empresa, para distribuição.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6155', 'Transferência de produção do estabelecimento, que não deva por ele transitar', 'Classificam-se neste código as transferências para outro estabelecimento da mesma empresa, de produtos industrializados no estabelecimento que tenham sido remetidos para armazém geral, depósito fechado ou outro, sem que haja retorno ao estabelecimento depositante.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6156', 'Transferência de mercadoria adquirida ou recebida de terceiros, que não deva por ele transitar', 'Classificam-se neste código as transferências para outro estabelecimento da mesma empresa, de mercadorias adquiridas ou recebidas de terceiros para industrialização ou comercialização, que não tenham sido objeto de qualquer processo industrial, remetidas para armazém geral, depósito fechado ou outro, sem que haja retorno ao estabelecimento depositante.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6200', 'DEVOLUÇÕES DE COMPRAS PARA INDUSTRIALIZAÇÃO, COMERCIALIZAÇÃO OU ANULAÇÕES DE VALORES', NULL);
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6201', 'Devolução de compra para industrialização', 'Classificam-se neste código as devoluções de mercadorias adquiridas para serem utilizadas em processo de industrialização, cujas entradas tenham sido classificadas como “Compra para industrialização”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6202', 'Devolução de compra para comercialização', 'Classificam-se neste código as devoluções de mercadorias adquiridas para serem comercializadas, cujas entradas tenham sido classificadas como “Compra para comercialização”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6205', 'Anulação de valor relativo a aquisição de serviço de comunicação', 'Classificam-se neste código as anulações correspondentes a valores faturados indevidamente, decorrentes das aquisições de serviços de comunicação.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6206', 'Anulação de valor relativo a aquisição de serviço de transporte', 'Classificam-se neste código as anulações correspondentes a valores faturados indevidamente, decorrentes das aquisições de serviços de transporte.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6207', 'Anulação de valor relativo à compra de energia elétrica', 'Classificam-se neste código as anulações correspondentes a valores faturados indevidamente, decorrentes da compra de energia elétrica.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6208', 'Devolução de mercadoria recebida em transferência para industrialização', 'Classificam-se neste código as devoluções de mercadorias recebidas em transferência de outros estabelecimentos da mesma empresa, para serem utilizadas em processo de industrialização.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6209', 'Devolução de mercadoria recebida em transferência para comercialização', 'Classificam-se neste código as devoluções de mercadorias recebidas em transferência de outro estabelecimento da mesma empresa, para serem comercializadas.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6210', 'Devolução de compra para utilização na prestação de serviço', 'Classificam-se neste código as devoluções de mercadorias adquiridas para utilização na prestação de serviços, cujas entradas tenham sido classificadas no código “2.126 - Compra para utilização na prestação de serviço”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6250', 'VENDAS DE ENERGIA ELÉTRICA', NULL);
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6251', 'Venda de energia elétrica para distribuição ou comercialização', 'Classificam-se neste código as vendas de energia elétrica destinada à distribuição ou comercialização. Também serão classificadas neste código as vendas de energia elétrica destinada a cooperativas para distribuição aos seus cooperados.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6252', 'Venda de energia elétrica para estabelecimento industrial', 'Classificam-se neste código as vendas de energia elétrica para consumo por estabelecimento industrial. Também serão classificadas neste código as vendas de energia elétrica destinada a estabelecimento industrial de cooperativa.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6253', 'Venda de energia elétrica para estabelecimento comercial', 'Classificam-se neste código as vendas de energia elétrica para consumo por estabelecimento comercial. Também serão classificadas neste código as vendas de energia elétrica destinada a estabelecimento comercial de cooperativa.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6254', 'Venda de energia elétrica para estabelecimento prestador de serviço de transporte', 'Classificam-se neste código as vendas de energia elétrica para consumo por estabelecimento de prestador de serviços de transporte.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6255', 'Venda de energia elétrica para estabelecimento prestador de serviço de comunicação', 'Classificam-se neste código as vendas de energia elétrica para consumo por estabelecimento de prestador de serviços de comunicação.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6256', 'Venda de energia elétrica para estabelecimento de produtor rural', 'Classificam-se neste código as vendas de energia elétrica para consumo por estabelecimento de produtor rural.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6257', 'Venda de energia elétrica para consumo por demanda contratada', 'Classificam-se neste código as vendas de energia elétrica para consumo por demanda contratada, que prevalecerá sobre os demais códigos deste subgrupo.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6258', 'Venda de energia elétrica a não-contribuinte', 'Classificam-se neste código as vendas de energia elétrica a pessoas físicas ou a pessoas jurídicas não indicadas nos códigos anteriores.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6300', 'PRESTAÇÕES DE SERVIÇOS DE COMUNICAÇÃO', NULL);
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6301', 'Prestação de serviço de comunicação para execução de serviço da mesma natureza', 'Classificam-se neste código as prestações de serviços de comunicação destinados às prestações de serviços da mesma natureza.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6302', 'Prestação de serviço de comunicação a estabelecimento industrial', 'Classificam-se neste código as prestações de serviços de comunicação a estabelecimento industrial. Também serão classificados neste código os serviços de comunicação prestados a estabelecimento industrial de cooperativa.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6303', 'Prestação de serviço de comunicação a estabelecimento comercial', 'Classificam-se neste código as prestações de serviços de comunicação a estabelecimento comercial. Também serão classificados neste código os serviços de comunicação prestados a estabelecimento comercial de cooperativa.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6304', 'Prestação de serviço de comunicação a estabelecimento de prestador de serviço de transporte', 'Classificam-se neste código as prestações de serviços de comunicação a estabelecimento prestador de serviço de transporte.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6305', 'Prestação de serviço de comunicação a estabelecimento de geradora ou de distribuidora de energia elétrica', 'Classificam-se neste código as prestações de serviços de comunicação a estabelecimento de geradora ou de distribuidora de energia elétrica.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6306', 'Prestação de serviço de comunicação a estabelecimento de produtor rural', 'Classificam-se neste código as prestações de serviços de comunicação a estabelecimento de produtor rural.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6307', 'Prestação de serviço de comunicação a não-contribuinte', 'Classificam-se neste código as prestações de serviços de comunicação a pessoas físicas ou a pessoas jurídicas não indicadas nos códigos anteriores.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6350', 'PRESTAÇÕES DE SERVIÇOS DE TRANSPORTE', NULL);
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6351', 'Prestação de serviço de transporte para execução de serviço da mesma natureza', 'Classificam-se neste código as prestações de serviços de transporte destinados às prestações de serviços da mesma natureza.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6352', 'Prestação de serviço de transporte a estabelecimento industrial', 'Classificam-se neste código as prestações de serviços de transporte a estabelecimento industrial. Também serão classificados neste código os serviços de transporte prestados a estabelecimento industrial de cooperativa.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6353', 'Prestação de serviço de transporte a estabelecimento comercial', 'Classificam-se neste código as prestações de serviços de transporte a estabelecimento comercial. Também serão classificados neste código os serviços de transporte prestados a estabelecimento comercial de cooperativa.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6354', 'Prestação de serviço de transporte a estabelecimento de prestador de serviço de comunicação', 'Classificam-se neste código as prestações de serviços de transporte a estabelecimento prestador de serviços de comunicação.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6355', 'Prestação de serviço de transporte a estabelecimento de geradora ou de distribuidora de energia elétrica', 'Classificam-se neste código as prestações de serviços de transporte a estabelecimento de geradora ou de distribuidora de energia elétrica.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6356', 'Prestação de serviço de transporte a estabelecimento de produtor rural', 'Classificam-se neste código as prestações de serviços de transporte a estabelecimento de produtor rural.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6357', 'Prestação de serviço de transporte a não-contribuinte', 'Classificam-se neste código as prestações de serviços de transporte a pessoas físicas ou a pessoas jurídicas não indicadas nos códigos anteriores.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6400', 'SAÍDAS DE MERCADORIAS SUJEITAS AO REGIME DE SUBSTITUIÇÃO TRIBUTÁRIA', NULL);
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6401', 'Venda de produção do estabelecimento em operação com produto sujeito ao regime de substituição tributária, na condição de contribuinte substituto', 'Classificam-se neste código as vendas de produtos industrializados no estabelecimento em operações com produtos sujeitos ao regime de substituição tributária, na condição de contribuinte substituto. Também serão classificadas neste código as vendas de produtos industrializados por estabelecimento industrial de cooperativa sujeitos ao regime de substituição tributária, na condição de contribuinte substituto.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6402', 'Venda de produção do estabelecimento de produto sujeito ao regime de substituição tributária, em operação entre contribuintes substitutos do mesmo produto', 'Classificam-se neste código as vendas de produtos sujeitos ao regime de substituição tributária industrializados no estabelecimento, em operações entre contribuintes substitutos do mesmo produto.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6403', 'Venda de mercadoria adquirida ou recebida de terceiros em operação com mercadoria sujeita ao regime de substituição tributária, na condição de contribuinte substituto', 'Classificam-se neste código as vendas de mercadorias adquiridas ou recebidas de terceiros, na condição de contribuinte substituto, em operação com mercadorias sujeitas ao regime de substituição tributária.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6404', 'Venda de mercadoria sujeita ao regime de substituição tributária, cujo imposto já tenha sido retido anteriormente', 'Classificam-se neste código as vendas de mercadorias sujeitas ao regime de substituição tributária, na condição de substituto tributário, exclusivamente nas hipóteses em que o imposto já tenha sido retido anteriormente.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6408', 'Transferência de produção do estabelecimento em operação com produto sujeito ao regime de substituição tributária', 'Classificam-se neste código os produtos industrializados no estabelecimento e transferidos para outro estabelecimento da mesma empresa, em operações com produtos sujeitos ao regime de substituição tributária.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6409', 'Transferência de mercadoria adquirida ou recebida de terceiros em operação com mercadoria sujeita ao regime de substituição tributária', 'Classificam-se neste código as transferências para outro estabelecimento da mesma empresa, de mercadorias adquiridas ou recebidas de terceiros que não tenham sido objeto de qualquer processo industrial no estabelecimento, em operações com mercadorias sujeitas ao regime de substituição tributária.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6410', 'Devolução de compra para industrialização em operação com mercadoria sujeita ao regime de substituição tributária', 'Classificam-se neste código as devoluções de mercadorias adquiridas para serem utilizadas em processo de industrialização cujas entradas tenham sido classificadas como “Compra para industrialização em operação com mercadoria sujeita ao regime de substituição tributária”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6411', 'Devolução de compra para comercialização em operação com mercadoria sujeita ao regime de substituição tributária', 'Classificam-se neste código as devoluções de mercadorias adquiridas para serem comercializadas, cujas entradas tenham sido classificadas como “Compra para comercialização em operação com mercadoria sujeita ao regime de substituição tributária”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6412', 'Devolução de bem do ativo imobilizado, em operação com mercadoria sujeita ao regime de substituição tributária', 'Classificam-se neste código as devoluções de bens adquiridos para integrar o ativo imobilizado do estabelecimento, cuja entrada tenha sido classificada no código “2.406 - Compra de bem para o ativo imobilizado cuja mercadoria está sujeita ao regime de substituição tributária”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6413', 'Devolução de mercadoria destinada ao uso ou consumo, em operação com mercadoria sujeita ao regime de substituição tributária', 'Classificam-se neste código as devoluções de mercadorias adquiridas para uso ou consumo do estabelecimento, cuja entrada tenha sido classificada no código “2.407 - Compra de mercadoria para uso ou consumo cuja mercadoria está sujeita ao regime de substituição tributária”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6414', 'Remessa de produção do estabelecimento para venda fora do estabelecimento em operação com produto sujeito ao regime de substituição tributária', 'Classificam-se neste código as remessas de produtos industrializados pelo estabelecimento para serem vendidos fora do estabelecimento, inclusive por meio de veículos, em operações com produtos sujeitos ao regime de substituição tributária.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6415', 'Remessa de mercadoria adquirida ou recebida de terceiros para venda fora do estabelecimento, em operação com mercadoria sujeita ao regime de substituição tributária', 'Classificam-se neste código as remessas de mercadorias adquiridas ou recebidas de terceiros para serem vendidas fora do estabelecimento, inclusive por meio de veículos, em operações com mercadorias sujeitas ao regime de substituição tributária.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6500', 'REMESSAS COM FIM ESPECÍFICO DE EXPORTAÇÃO E EVENTUAIS DEVOLUÇÕES', NULL);
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6501', 'Remessa de produção do estabelecimento, com fim específico de exportação', 'Classificam-se neste código as saídas de produtos industrializados pelo estabelecimento, remetidos com fim específico de exportação a “trading company”, empresa comercial exportadora ou outro estabelecimento do remetente.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6502', 'Remessa de mercadoria adquirida ou recebida de terceiros, com fim específico de exportação', 'Classificam-se neste código as saídas de mercadorias adquiridas ou recebidas de terceiros, remetidas com fim específico de exportação a “trading company”, empresa comercial exportadora ou outro estabelecimento do remetente.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6503', 'Devolução de mercadoria recebida com fim específico de exportação', 'Classificam-se neste código as devoluções efetuadas por “trading company”, empresa comercial exportadora ou outro estabelecimento do destinatário, de mercadorias recebidas com fim específico de exportação, cujas entradas tenham sido classificadas no código “2.501 - Entrada de mercadoria recebida com fim específico de exportação”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6550', 'OPERAÇÕES COM BENS DE ATIVO IMOBILIZADO E MATERIAIS PARA USO OU CONSUMO', NULL);
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6551', 'Venda de bem do ativo imobilizado', 'Classificam-se neste código as vendas de bens integrantes do ativo imobilizado do estabelecimento.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6552', 'Transferência de bem do ativo imobilizado', 'Classificam-se neste código os bens do ativo imobilizado transferidos para outro estabelecimento da mesma empresa.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6553', 'Devolução de compra de bem para o ativo imobilizado', 'Classificam-se neste código as devoluções de bens adquiridos para integrar o ativo imobilizado do estabelecimento, cuja entrada foi classificada no código “2.551 - Compra de bem para o ativo imobilizado”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6554', 'Remessa de bem do ativo imobilizado para uso fora do estabelecimento', 'Classificam-se neste código as remessas de bens do ativo imobilizado para uso fora do estabelecimento.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6555', 'Devolução de bem do ativo imobilizado de terceiro, recebido para uso no estabelecimento', 'Classificam-se neste código as saídas em devolução, de bens do ativo imobilizado de terceiros, recebidos para uso no estabelecimento, cuja entrada tenha sido classificada no código “2.555 - Entrada de bem do ativo imobilizado de terceiro, remetido para uso no estabelecimento”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6556', 'Devolução de compra de material de uso ou consumo', 'Classificam-se neste código as devoluções de mercadorias destinadas ao uso ou consumo do estabelecimento, cuja entrada tenha sido classificada no código “2.556 - Compra de material para uso ou consumo”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6557', 'Transferência de material de uso ou consumo', 'Classificam-se neste código os materiais de uso ou consumo transferidos para outro estabelecimento da mesma empresa.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6600', 'CRÉDITOS E RESSARCIMENTOS DE ICMS', NULL);
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6603', 'Ressarcimento de ICMS retido por substituição tributária', 'Classificam-se neste código os lançamentos destinados ao registro de ressarcimento de ICMS retido por substituição tributária a contribuinte substituído, efetuado pelo contribuinte substituto, nas hipóteses previstas na legislação aplicável.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6900', 'OUTRAS SAÍDAS DE MERCADORIAS OU PRESTAÇÕES DE SERVIÇOS', NULL);
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6901', 'Remessa para industrialização por encomenda', 'Classificam-se neste código as remessas de insumos remetidos para industrialização por encomenda, a ser realizada em outra empresa ou em outro estabelecimento da mesma empresa.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6902', 'Retorno de mercadoria utilizada na industrialização por encomenda', 'Classificam-se neste código as remessas, pelo estabelecimento industrializador, dos insumos recebidos para industrialização e incorporados ao produto final, por encomenda de outra empresa ou de outro estabelecimento da mesma empresa. O valor dos insumos nesta operação deverá ser igual ao valor dos insumos recebidos para industrialização.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6903', 'Retorno de mercadoria recebida para industrialização e não aplicada no referido processo', 'Classificam-se neste código as remessas em devolução de insumos recebidos para industrialização e não aplicados no referido processo.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6904', 'Remessa para venda fora do estabelecimento', 'Classificam-se neste código as remessas de mercadorias para venda fora do estabelecimento, inclusive por meio de veículos.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6905', 'Remessa para depósito fechado ou armazém geral', 'Classificam-se neste código as remessas de mercadorias para depósito em depósito fechado ou armazém geral.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6906', 'Retorno de mercadoria depositada em depósito fechado ou armazém geral', 'Classificam-se neste código os retornos de mercadorias depositadas em depósito fechado ou armazém geral ao estabelecimento depositante.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6907', 'Retorno simbólico de mercadoria depositada em depósito fechado ou armazém geral', 'Classificam-se neste código os retornos simbólicos de mercadorias recebidas para depósito em depósito fechado ou armazém geral, quando as mercadorias depositadas tenham sido objeto de saída a qualquer título e que não devam retornar ao estabelecimento depositante.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6908', 'Remessa de bem por conta de contrato de comodato', 'Classificam-se neste código as remessas de bens para o cumprimento de contrato de comodato.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6909', 'Retorno de bem recebido por conta de contrato de comodato', 'Classificam-se neste código as remessas de bens em devolução após cumprido o contrato de comodato.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6910', 'Remessa em bonificação, doação ou brinde', 'Classificam-se neste código as remessas de mercadorias a título de bonificação, doação ou brinde.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6911', 'Remessa de amostra grátis', 'Classificam-se neste código as remessas de mercadorias a título de amostra grátis.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6912', 'Remessa de mercadoria ou bem para demonstração', 'Classificam-se neste código as remessas de mercadorias ou bens para demonstração.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6913', 'Retorno de mercadoria ou bem recebido para demonstração', 'Classificam-se neste código as remessas em devolução de mercadorias ou bens recebidos para demonstração.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6914', 'Remessa de mercadoria ou bem para exposição ou feira', 'Classificam-se neste código as remessas de mercadorias ou bens para exposição ou feira.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6915', 'Remessa de mercadoria ou bem para conserto ou reparo', 'Classificam-se neste código as remessas de mercadorias ou bens para conserto ou reparo.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6916', 'Retorno de mercadoria ou bem recebido para conserto ou reparo', 'Classificam-se neste código as remessas em devolução de mercadorias ou bens recebidos para conserto ou reparo.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6917', 'Remessa de mercadoria em consignação mercantil ou industrial', 'Classificam-se neste código as remessas de mercadorias a título de consignação mercantil ou industrial.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6918', 'Devolução de mercadoria recebida em consignação mercantil ou industrial', 'Classificam-se neste código as devoluções de mercadorias recebidas anteriormente a título de consignação mercantil ou industrial.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6919', 'Devolução simbólica de mercadoria vendida ou utilizada em processo industrial, recebida anteriormente em consignação mercantil ou industrial', 'Classificam-se neste código as devoluções simbólicas de mercadorias vendidas ou utilizadas em processo industrial, que tenham sido recebidas anteriormente a título de consignação mercantil ou industrial.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6920', 'Remessa de vasilhame ou sacaria', 'Classificam-se neste código as remessas de vasilhame ou sacaria.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6921', 'Devolução de vasilhame ou sacaria', 'Classificam-se neste código as saídas por devolução de vasilhame ou sacaria.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6922', 'Lançamento efetuado a título de simples faturamento decorrente de venda para entrega futura', 'Classificam-se neste código os registros efetuados a título de simples faturamento decorrente de venda para entrega futura.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6923', 'Remessa de mercadoria por conta e ordem de terceiros, em venda à ordem', 'Classificam-se neste código as saídas correspondentes à entrega de mercadorias por conta e ordem de terceiros, em vendas à ordem, cuja venda ao adquirente originário, foi classificada nos códigos “6.118 - Venda de produção do estabelecimento entregue ao destinatário por conta e ordem do adquirente originário, em venda à ordem” ou “6.119 - Venda de mercadoria adquirida ou recebida de terceiros entregue ao destinatário por conta e ordem do adquirente originário, em venda à ordem”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6924', 'Remessa para industrialização por conta e ordem do adquirente da mercadoria, quando esta não transitar pelo estabelecimento do adquirente', 'Classificam-se neste código as saídas de insumos com destino a estabelecimento industrializador, para serem industrializados por conta e ordem do adquirente, nas hipóteses em que os insumos não tenham transitado pelo estabelecimento do adquirente dos mesmos.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6925', 'Retorno de mercadoria recebida para industrialização por conta e ordem do adquirente da mercadoria, quando aquela não transitar pelo estabelecimento do adquirente', 'Classificam-se neste código as remessas, pelo estabelecimento industrializador, dos insumos recebidos, por conta e ordem do adquirente, para industrialização e incorporados ao produto final, nas hipóteses em que os insumos não tenham transitado pelo estabelecimento do adquirente. O valor dos insumos nesta operação deverá ser igual ao valor dos insumos recebidos para industrialização.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6929', 'Lançamento efetuado em decorrência de emissão de documento fiscal relativo a operação ou prestação também registrada em equipamento Emissor de Cupom Fiscal - ECF', 'Classificam-se neste código os registros relativos aos documentos fiscais emitidos em operações ou prestações que também tenham sido registradas em equipamento Emissor de Cupom Fiscal - ECF.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6931', 'Lançamento efetuado em decorrência da respons. de retenção do imposto por subst. tributária, atribuída ao rem. ou alienante da merc., pelo serv. de transp. realizado por transp. autônomo ou por transp. não inscrito na UF onde iniciado o serviço', 'Classificam-se neste código exclusivamente os lançamentos efetuados pelo remetente ou alienante da mercadoria quando lhe for atribuída a responsabilidade pelo recolhimento do imposto devido pelo serviço de transporte realizado por transportador autônomo ou por transportador não inscrito na unidade da Federação onde iniciado o serviço.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6932', 'Prestação de serviço de transporte iniciada em unidade da Federação diversa daquela onde inscrito o prestador', 'Classificam-se neste código as prestações de serviço de transporte que tenham sido iniciadas em unidade da Federação diversa daquela onde o prestador está inscrito como contribuinte.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('6949', 'Outra saída de mercadoria ou prestação de serviço não especificado', 'Classificam-se neste código as outras saídas de mercadorias ou prestações de serviços que não tenham sido especificados nos códigos anteriores.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('7000', 'SAÍDAS OU PRESTAÇÕES DE SERVIÇOS PARA O EXTERIOR', 'Classificam-se, neste grupo, as operações ou prestações em que o destinatário esteja localizado em outro país. ');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('7100', 'VENDAS DE PRODUÇÃO PRÓPRIA OU DE TERCEIROS', NULL);
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('7101', 'Venda de produção do estabelecimento', 'Classificam-se neste código as vendas de produtos industrializados no estabelecimento. Também serão classificadas neste código as vendas de mercadorias por estabelecimento industrial de cooperativa.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('7102', 'Venda de mercadoria adquirida ou recebida de terceiros', 'Classificam-se neste código as vendas de mercadorias adquiridas ou recebidas de terceiros para industrialização ou comercialização, que não tenham sido objeto de qualquer processo industrial no estabelecimento. Também serão classificadas neste código as vendas de mercadorias por estabelecimento comercial de cooperativa.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('7105', 'Venda de produção do estabelecimento, que não deva por ele transitar', 'Classificam-se neste código as vendas de produtos industrializados no estabelecimento, armazenados em depósito fechado, armazém geral ou outro sem que haja retorno ao estabelecimento depositante.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('7106', 'Venda de mercadoria adquirida ou recebida de terceiros, que não deva por ele transitar', 'Classificam-se neste código as vendas de mercadorias adquiridas ou recebidas de terceiros para industrialização ou comercialização, armazenadas em depósito fechado, armazém geral ou outro, que não tenham sido objeto de qualquer processo industrial no estabelecimento sem que haja retorno ao estabelecimento depositante. Também serão classificadas neste código as vendas de mercadorias importadas, cuja saída ocorra do recinto alfandegado ou da repartição alfandegária onde se processou o desembaraço aduaneiro, com destino ao estabelecimento do comprador, sem transitar pelo estabelecimento do importador.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('7127', 'Venda de produção do estabelecimento sob o regime de “drawback”', 'Classificam-se neste código as vendas de produtos industrializados no estabelecimento sob o regime de “drawback”, cujas compras foram classificadas no código “3.127 - Compra para industrialização sob o regime de “drawback””.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('7200', 'DEVOLUÇÕES DE COMPRAS PARA INDUSTRIALIZAÇÃO, COMERCIALIZAÇÃO OU ANULAÇÕES DE VALORES', NULL);
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('7201', 'Devolução de compra para industrialização', 'Classificam-se neste código as devoluções de mercadorias adquiridas para serem utilizadas em processo de industrialização, cujas entradas tenham sido classificadas como “Compra para industrialização”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('7202', 'Devolução de compra para comercialização', 'Classificam-se neste código as devoluções de mercadorias adquiridas para serem comercializadas, cujas entradas tenham sido classificadas como “Compra para comercialização”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('7205', 'Anulação de valor relativo à aquisição de serviço de comunicação', 'Classificam-se neste código as anulações correspondentes a valores faturados indevidamente, decorrentes das aquisições de serviços de comunicação.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('7206', 'Anulação de valor relativo a aquisição de serviço de transporte', 'Classificam-se neste código as anulações correspondentes a valores faturados indevidamente, decorrentes das aquisições de serviços de transporte.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('7207', 'Anulação de valor relativo à compra de energia elétrica', 'Classificam-se neste código as anulações correspondentes a valores faturados indevidamente, decorrentes da compra de energia elétrica.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('7210', 'Devolução de compra para utilização na prestação de serviço', 'Classificam-se neste código as devoluções de mercadorias adquiridas para utilização na prestação de serviços, cujas entradas tenham sido classificadas no código “3.126 - Compra para utilização na prestação de serviço”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('7211', 'Devolução de compras para industrialização sob o regime de “drawback”', 'Classificam-se neste código as devoluções de mercadorias adquiridas para serem utilizadas em processo de industrialização sob o regime de “drawback” e não utilizadas no referido processo, cujas entradas tenham sido classificadas no código “3.127 - Compra para industrialização sob o regime de “drawback””.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('7250', 'VENDAS DE ENERGIA ELÉTRICA', NULL);
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('7251', 'Venda de energia elétrica para o exterior', 'Classificam-se neste código as vendas de energia elétrica para o exterior.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('7300', 'PRESTAÇÕES DE SERVIÇOS DE COMUNICAÇÃO', NULL);
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('7301', 'Prestação de serviço de comunicação para execução de serviço da mesma natureza', 'Classificam-se neste código as prestações de serviços de comunicação destinados às prestações de serviços da mesma natureza.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('7350', 'PRESTAÇÕES DE SERVIÇO DE TRANSPORTE', NULL);
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('7358', 'Prestação de serviço de transporte', 'Classificam-se neste código as prestações de serviços de transporte destinado a estabelecimento no exterior.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('7500', 'EXPORTAÇÃO DE MERCADORIAS RECEBIDAS COM FIM ESPECÍFICO DE EXPORTAÇÃO', NULL);
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('7501', 'Exportação de mercadorias recebidas com fim específico de exportação', 'Classificam-se neste código as exportações das mercadorias recebidas anteriormente com finalidade específica de exportação, cujas entradas tenham sido classificadas nos códigos “1.501 - Entrada de mercadoria recebida com fim específico de exportação” ou “2.501 - Entrada de mercadoria recebida com fim específico de exportação”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('7550', 'OPERAÇÕES COM BENS DE ATIVO IMOBILIZADO E MATERIAIS PARA USO OU CONSUMO', NULL);
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('7551', 'Venda de bem do ativo imobilizado', 'Classificam-se neste código as vendas de bens integrantes do ativo imobilizado do estabelecimento.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('7553', 'Devolução de compra de bem para o ativo imobilizado', 'Classificam-se neste código as devoluções de bens adquiridos para integrar o ativo imobilizado do estabelecimento, cuja entrada foi classificada no código “3.551 - Compra de bem para o ativo imobilizado”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('7556', 'Devolução de compra de material de uso ou consumo', 'Classificam-se neste código as devoluções de mercadorias destinadas ao uso ou consumo do estabelecimento, cuja entrada tenha sido classificada no código “3.556 - Compra de material para uso ou consumo”.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('7900', 'OUTRAS SAÍDAS DE MERCADORIAS OU PRESTAÇÕES DE SERVIÇOS', NULL);
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('7930', 'Lançamento efetuado a título de devolução de bem cuja entrada tenha ocorrido sob amparo de regime especial aduaneiro de admissão temporária', 'Classificam-se neste código os lançamentos efetuados a título de saída em devolução de bens cuja entrada tenha ocorrido sob amparo de regime especial aduaneiro de admissão temporária.');
INSERT INTO CFOP (CFCOD, CFNOME, CFNOTA) VALUES ('7949', 'Outra saída de mercadoria ou prestação de serviço não especificado', 'Classificam-se neste código as outras saídas de mercadorias ou prestações de serviços que não tenham sido especificados nos códigos anteriores.');
